CREATE DEFINER=`root`@`localhost` FUNCTION `fn_getCodeGen`(`pTransType` varchar(3), `pOrgId` INT) RETURNS varchar(20) CHARSET utf8mb3
BEGIN

DECLARE pHeaderCode VARCHAR(20);
DECLARE pId INT;
DECLARE pcodelimit INT;
DECLARE pcodelength INT;
DECLARE pCodePattern Varchar(3);
IF EXISTS(Select AutoID from codegenerator where TransType = pTransType and OrgId = pOrgID)THEN

UPDATE codegenerator SET HeaderCode = HeaderCode + 1 WHERE  OrgID = pOrgID AND TransType = pTransType;

SET pcodelength = (select length(HeaderCode) from codegenerator WHERE OrgID = pOrgID AND TransType = pTransType);

SET pcodelimit = (Select (HCodeLimit - pcodelength) from codegenerator WHERE OrgID = pOrgID AND TransType = pTransType);

SET pId = (Select HeaderCode from codegenerator WHERE OrgID = pOrgID AND TransType = pTransType);

SET pHeaderCode = (SELECT CONCAT(FormatStr,LPAD(0,pcodelimit,0),pId) from codegenerator WHERE OrgID = pOrgID AND TransType = pTransType);
ELSE
SET pCodePattern = (select CodePattern from orgmaster where id = pOrgID);
Insert into codegenerator(FormatStr, TransType, HCodeLimit, LCodeLimit, HeaderCode, OrgID)
Values(pCodePattern,pTransType,9,3,1,pOrgID);

SET pcodelength = (select length(HeaderCode) from codegenerator WHERE OrgID = pOrgID AND TransType = pTransType);

SET pcodelimit = (Select (HCodeLimit - pcodelength) from codegenerator WHERE OrgID = pOrgID AND TransType = pTransType);

SET pId = (Select HeaderCode from codegenerator WHERE OrgID = pOrgID AND TransType = pTransType);

SET pHeaderCode = (SELECT CONCAT(FormatStr,LPAD(0,pcodelimit,0),pId) from codegenerator WHERE OrgID = pOrgID AND TransType = pTransType);
END IF;

RETURN pHeaderCode;

END ;;
DELIMITER ;
