DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pday_Dye`(IN `pdate` date)
BEGIN
SELECT 
    ANY_VALUE(d.dyeFactory) AS dyeFactory,
    d.buyer,
    d.orderNo,
    d.style,
    d.color,
    dl.size,
    ANY_VALUE(wo.finishKg) AS finishKg ,
   sum( CASE
    WHEN DATE_FORMAT (d.batch_batchMakeDate , "%Y-%m-%d") = pdate THEN dl.griege 
    ELSE "NoEntry"
    END) AS OnedayProductionKgs , 
       sum( CASE
    WHEN DATE_FORMAT (d.batch_batchMakeDate , "%Y-%m-%d") <= pdate THEN dl.griege 
    ELSE "NoEntry"
    END) AS AlldayProductionKgs
FROM
    dye d
JOIN
    dye_line dl ON d.id = dl.dyeId
JOIN
    workorder wo ON wo.buyer = d.buyer AND wo.orderNo = d.orderNo AND wo.style = d.style AND wo.color = d.color AND wo.size = dl.size
GROUP BY
    d.buyer,
    d.orderNo,
    d.style,
    d.color,
    dl.size;
END ;;
DELIMITER ;
