CREATE DEFINER=`root`@`localhost` PROCEDURE `pday_Knit`(IN `pdate` date)
BEGIN
SELECT 
    ANY_VALUE(k.factory) AS factory,
    kl.buyer,
    kl.orderNo,
    kl.style,
    kl.color,
    kl.size,
    ANY_VALUE(wo.greigeKg) AS greigeKg ,
   sum( CASE
    WHEN DATE_FORMAT (k.date , "%Y-%m-%d") = pdate THEN kl.dayProductionKgs 
    ELSE "NoEntry"
    END) AS OnedayProductionKgs , 
       sum( CASE
    WHEN DATE_FORMAT (k.date , "%Y-%m-%d") <= pdate THEN kl.dayProductionKgs 
    ELSE "NoEntry"
    END) AS AlldayProductionKgs
FROM
    knit k
JOIN
    knit_line kl ON k.id = kl.knitId
JOIN
    workorder wo ON wo.buyer = kl.buyer AND wo.orderNo = kl.orderNo AND wo.style = kl.style AND wo.color = kl.color AND wo.size = kl.size
GROUP BY
    kl.buyer,
    kl.orderNo,
    kl.style,
    kl.color,
    kl.size;
END ;;
DELIMITER ;
