CREATE DEFINER=`root`@`localhost` PROCEDURE `pdyefactoryinventory`(IN `pdate` date ,IN `porgId` int)
BEGIN
select 
buyer, 
orderNo, 
    style, 
    color, 
    ANY_VALUE (dyeinFty) as dyeinFty, 
    round(sum(yarnKg),2) as yarnKg, 
    ANY_VALUE(createdAt) as createdAt, 
    round(sum(finishKg),2) as finishKg, 
    ANY_VALUE(production_date1) as production_date1, 
    round(sum(KnitGreigeDeliveryKgs),2) as KnitGreigeDeliveryKgs, 
    ANY_VALUE(production_date2) as production_date2, 
    round(sum(DyeGriegeDeliveryKgs),2) as DyeGriegeDeliveryKgs, 
    ANY_VALUE(production_date4) as production_date4, 
    round(sum(DyeFinishDeliveryKgs),2) as DyeFinishDeliveryKgs
 from ( select 
WO.buyer , 
WO.orderNo , 
WO.style , 
WO.color ,
ANY_VALUE(dn.dyeFactory) as dyeinFty, 
ANY_VALUE(WO.yarnKg) as yarnKg , 
ANY_VALUE(date_format(WO.createdAt,"%Y-%m-%d")) as createdAt , 
ANY_VALUE(WO.finishKg) as finishKg , 
ANY_VALUE(date_format(te1.production_date,"%Y-%m-%d")) as production_date1 , 
ANY_VALUE(te1.entry_1) as KnitGreigeDeliveryKgs , 
ANY_VALUE(date_format(te2.production_date,"%Y-%m-%d")) as production_date2 , 
ANY_VALUE(te2.entry_2) as DyeGriegeDeliveryKgs ,
ANY_VALUE(date_format(te4.production_date,'%Y-%m-%d')) as production_date4 ,
ANY_VALUE(te4.entry_4) as DyeFinishDeliveryKgs 
from workorder WO 
join(SELECT d.dyeFactory , d.buyer , d.orderNo , d.style , d.color , d.createdAt  FROM dye AS d) AS dn 
on WO.buyer = dn.buyer AND WO.orderNo = dn.orderNo AND WO.style = dn.style AND WO.color = dn.color
join transcation_entry1 te1 on WO.id = te1.workorderId
join transcation_entry2 te2 on WO.id = te2.workorderId
join transcation_entry4 te4 on WO.id = te4.workorderId
GROUP BY WO.buyer , WO.orderNo , WO.style , WO.color
) as kf 
where 
date_format(createdAt,"%Y-%m-%d") and 
date_format(production_date1,"%Y-%m-%d") and 
date_format(production_date2,"%Y-%m-%d") and 
date_format(production_date4,"%Y-%m-%d") <= pdate
Group by buyer, orderNo, style, color ;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
