DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pdye_batch`(IN `pdate1` date , IN `pdate2` date ,IN `porgId` int)
BEGIN
select 
ANY_VALUE(dyeFactory) AS dyeFactory, 
    buyer, 
    orderNo, 
    style, 
    color, 
    size, 
    batchNo, 
    ROUND( SUM(ANY_VALUE(griege) ),2) AS griege, 
    ROUND( SUM(ANY_VALUE(finish) ),2) AS finish, 
    ANY_VALUE(batch_batchMakeDate) AS batchDate, 
    ANY_VALUE(ApprovalDate) AS ApprovalDate from (
select 
d.dyeFactory , 
    d.buyer , 
    d.orderNo , 
    d.style ,
    d.color , 
    dl.size , 
    d.batchNo ,
    dl.griege , 
    dl.finish , 
   date_format( d.batch_batchMakeDate ,"%Y-%m-%d") as batch_batchMakeDate,
   date_format( d.shade_shadeApprovalDate , "%Y-%m-%d" ) as ApprovalDate
from 
dye d 
join 
dye_line dl on d.id = dl.dyeId
WHERE 
batch_batchMakeDate 
BETWEEN 
pdate1 AND pdate2   
) as DyeBatch
GROUP BY   
buyer, 
    orderNo, 
    style, 
    color, 
    size ,
    batchNo ; 
END ;;
DELIMITER ;
