CREATE DEFINER=`root`@`localhost` PROCEDURE `pgetall_dye`(IN `porgId` int)
BEGIN
select D.id,D.code,D.dyeFactory,D.buyer,D.orderNo,D.style,D.color,D.orgId,D.createdAt , round(sum(dl.greigerolls),2) as total_greige_rolls , round(sum(dl.griege),2) as total_greige , round(sum(dl.finishrolls),2) as total_finish_rolls, round(sum(dl.finish),2) as finish_rolls , round(sum(dl.difference),2) as difference, round(sum(dl.processloss),2) as processloss , DATE_FORMAT(D.batch_batchMakeDate, '%Y-%m-%d') as date from dye D inner join dye_line dl on D.id = dl.dyeId
where D.orgId = porgId and D.status = 1 and D.delStatus = 0 GROUP BY D.id, D.code, D.dyeFactory, D.buyer, D.orderNo, D.style, D.color, D.orgId, D.createdAt;
END ;;
