CREATE DEFINER=`root`@`localhost` PROCEDURE `pgetall_dyeworkorder`(IN porgId int)
BEGIN
SELECT 
    kt.id, 
    kt.dyefty, 
    kt.dyefty_details, 
    kt.buyer,
    kt.orderNo,
    kt.woNo,
    kt.woRefNo,
    DATE_FORMAT(kt.woDate, '%Y-%m-%d') as woDate, 
    DATE_FORMAT(kt.completedDate, '%Y-%m-%d') as completedDate, 
    kt.notes,
    kt.orgId, 
    kt.createdAt ,
    sum(dl.greigeKg) as dyeKgs , 
    sum(dl.dyeValue) as dyeValue ,
ANY_VALUE(( SELECT JSON_ARRAYAGG(JSON_OBJECT('color', color)) FROM (SELECT DISTINCT color FROM dyeworkorder_line WHERE dyeWoId = kt.id) AS distinct_colors ) ) AS colors
FROM 
    dyeworkorder kt 
JOIN 
dyeworkorder_line dl on kt.id = dl.dyeWoId

WHERE 
    kt.orgId = porgId
    AND kt.status = 1 
    AND kt.delStatus = 0
GROUP BY  kt.id ;
select sum(dyeKgs) as dyeKgs from (
SELECT 
    kt.id, 
    kt.dyefty, 
    kt.dyefty_details, 
    kt.buyer,
    kt.orderNo,
    kt.woNo,
    kt.woRefNo,
    DATE_FORMAT(kt.woDate, '%Y-%m-%d') as woDate, 
    DATE_FORMAT(kt.completedDate, '%Y-%m-%d') as completedDate, 
    kt.notes,
    kt.orgId, 
    kt.createdAt ,
    sum(dl.greigeKg) as dyeKgs , 
    sum(dl.dyeValue) as dyeValue
FROM 
    dyeworkorder kt 
JOIN 
dyeworkorder_line dl on kt.id = dl.dyeWoId

WHERE 
    kt.orgId = porgId
    AND kt.status = 1 
    AND kt.delStatus = 0
GROUP BY  kt.id 
) as A ;
END ;;
DELIMITER ;
