CREATE DEFINER=`root`@`localhost` PROCEDURE `pgetall_knitworkorder`(IN porgId int)
BEGIN
select sum(knitKgTotal) as knitKgTotal from (
SELECT sum(ktl.knitKg) as knitKgTotal FROM knitworkorder kt JOIN knitworkorder_line ktl on kt.id = ktl.knitWoId
WHERE kt.orgId = 1 AND kt.status = 1 AND kt.delStatus = 0
GROUP BY 
        kt.id,
        kt.knitfty, 
        kt.knitfty_details, 
        kt.buyer,
        kt.orderNo,
        kt.woNo,
        kt.woRefNo,
        kt.woDate, 
        kt.completedDate, 
        kt.knitValue,
        kt.notes,
        kt.orgId, 
        kt.createdAt ) as knitKgTotal;

SELECT 
    kt.id, 
    kt.knitfty, 
    kt.knitfty_details,
kt.buyer,
    kt.orderNo,
    kt.woNo,
    kt.woRefNo,
( SELECT JSON_ARRAYAGG(JSON_OBJECT('color', color))
FROM (SELECT DISTINCT color FROM knitworkorder_line WHERE knitWoId = kt.id ) AS distinct_colors ) AS colors,
    DATE_FORMAT(kt.woDate, '%Y-%m-%d') as woDate, 
    DATE_FORMAT(kt.completedDate, '%Y-%m-%d') as completedDate, 
sum(ktl.knitKg) as knitKg,
    sum(ktl.knitValue) as knitValue,
    kt.notes,
    kt.orgId, 
    kt.createdAt 
FROM 
    knitworkorder kt 
JOIN knitworkorder_line ktl on kt.id = ktl.knitWoId

WHERE 
    kt.orgId = 1 
    AND kt.status = 1 
    AND kt.delStatus = 0
GROUP BY 
        kt.id,
        kt.knitfty, 
        kt.knitfty_details, 
        kt.buyer,
        kt.orderNo,
        kt.woNo,
        kt.woRefNo,
        kt.woDate, 
        kt.completedDate, 
        kt.knitValue,
        kt.notes,
        kt.orgId, 
        kt.createdAt ;
END ;;
