CREATE DEFINER=`root`@`localhost` PROCEDURE `pgetall_knit_delivery_Fillter`(IN pknitfty VARCHAR(255), IN porgId INT)
BEGIN
select distinct factory from knit_delivery;
IF LENGTH(pknitfty) = 0 THEN
SELECT 
kd.id,
kd.factory, 
ANY_VALUE( DATE_FORMAT(kd.date, '%Y-%m-%d') ) AS date, 
ANY_VALUE((
SELECT 
JSON_ARRAYAGG(JSON_OBJECT('color', color))
FROM 
(SELECT DISTINCT color 
FROM knit_delivery_line 
WHERE knitDelId = kd.id) AS distinct_colors
) ) AS colors,
ANY_VALUE( (
SELECT 
JSON_ARRAYAGG(JSON_OBJECT('orderNo', orderNo))
FROM 
(SELECT DISTINCT orderNo 
FROM knit_delivery_line 
WHERE knitDelId = kd.id) AS distinct_orders
) ) AS orderNo, 
ANY_VALUE(  kd.totalrolls ) AS totalrolls, 
ANY_VALUE( kd.totalKg ) AS totalKg
FROM 
knit_delivery kd 
JOIN 
knit_delivery_line kdl 
ON 
kd.id = kdl.knitDelId
WHERE 
kd.orgId = 1 
AND kd.status = 1 
AND kd.delStatus = 0 
GROUP BY 
kd.id,
kd.factory ;
ELSE
SELECT 
kd.id,
kd.factory, 
ANY_VALUE( DATE_FORMAT(kd.date, '%Y-%m-%d') ) AS date, 
ANY_VALUE((
SELECT 
JSON_ARRAYAGG(JSON_OBJECT('color', color))
FROM 
(SELECT DISTINCT color 
FROM knit_delivery_line 
WHERE knitDelId = kd.id) AS distinct_colors
) ) AS colors,
ANY_VALUE( (
SELECT 
JSON_ARRAYAGG(JSON_OBJECT('orderNo', orderNo))
FROM 
(SELECT DISTINCT orderNo 
FROM knit_delivery_line 
WHERE knitDelId = kd.id) AS distinct_orders
) ) AS orderNo, 
ANY_VALUE(  kd.totalrolls ) AS totalrolls, 
ANY_VALUE( kd.totalKg ) AS totalKg
FROM 
knit_delivery kd 
JOIN 
knit_delivery_line kdl 
ON 
kd.id = kdl.knitDelId
WHERE 
kd.orgId = 1 
AND kd.status = 1 
AND kd.delStatus = 0 
AND kd.factory = pknitfty
GROUP BY 
kd.id,
kd.factory ;
END IF;
END ;;
DELIMITER ;
