CREATE DEFINER=`root`@`localhost` PROCEDURE `pgetall_rejType_master_filter`(IN `prejName` varchar(255) ,IN `porgId` int)
BEGIN
IF LENGTH(prejName) = 0 THEN
SELECT 
        A.*, 
        (SELECT json_arrayagg(json_object('id', B.id, 'color', B.color))
         FROM rej_type_master_line B 
         WHERE B.rejTypeId = A.id) as color 
    FROM 
        rej_type_master A 
    WHERE 
        A.delStatus = 0 
        AND A.orgId = porgId;
    ELSE
SELECT 
        A.*, 
        (SELECT json_arrayagg(json_object('id', B.id, 'color', B.color))
         FROM rej_type_master_line B 
         WHERE B.rejTypeId = A.id) as color 
    FROM 
        rej_type_master A 
WHERE A.delStatus = 0 AND A.orgId = porgId and A.rejName like concat('%', prejName, '%');
    END IF;
END ;;
