CREATE DEFINER=`root`@`localhost` PROCEDURE `pgetall_workorder`(IN `porgId` int)
BEGIN

select buyer, orderNo, round(sum(yarnKg),2) as yarnKg, round(sum(greigeKg),2) as greigeKg, 
round(sum(finishKg), 2) as finishKg, sum(orderPcs) as orderPcs, 
round(sum(orderPcs * orderFOBRate),2) as orderValue, status
from workorder
where orgId = porgId and status = 1 and delStatus = 0 group by buyer, orderNo, status;

END ;;
