CREATE DEFINER=`root`@`localhost` PROCEDURE `pget_fabric_booking_report`(
IN pbuyer VARCHAR(255),
IN porder VARCHAR(255),
IN porgId INT
)
BEGIN

DECLARE loopid INT DEFAULT 1;
DECLARE datacount INT;
DECLARE pstyle VARCHAR(255);
DECLARE pid INT;


SET pid = (
SELECT id 
FROM po_master 
WHERE buyer = pbuyer 
AND orderNo = porder 
AND status = 1 
AND delStatus = 0
);


DROP TEMPORARY TABLE IF EXISTS temp_fabric_booking;
CREATE TEMPORARY TABLE temp_fabric_booking (
id INT NOT NULL AUTO_INCREMENT,
style VARCHAR(255) DEFAULT NULL,
pohead LONGTEXT DEFAULT NULL,
headers LONGTEXT DEFAULT NULL,
garment_break_down LONGTEXT DEFAULT NULL,
finish_fabric LONGTEXT DEFAULT NULL,
greige_fabric LONGTEXT DEFAULT NULL,
PRIMARY KEY(id)
);


SELECT buyer, orderNo, DATE_FORMAT(createdAt, '%d-%m-%Y') AS created_date, DATE_FORMAT(modifiedAt, '%d-%m-%Y') AS revised_date 
FROM po_master 
WHERE id = pid 
AND status = 1 
AND delStatus = 0;


DROP TEMPORARY TABLE IF EXISTS tmp_style;
CREATE TEMPORARY TABLE tmp_style (
id INT NOT NULL AUTO_INCREMENT,
style VARCHAR(255) DEFAULT NULL,
PRIMARY KEY(id)
);


INSERT INTO tmp_style (style)
SELECT DISTINCT style 
FROM po_master_line 
WHERE orderId = pid 
AND status = 1 
AND delStatus = 0;


SET loopid = 1;
SET datacount = (SELECT COUNT(*) FROM tmp_style);


WHILE loopid <= datacount DO

SET pstyle = (SELECT style FROM tmp_style WHERE id = loopid);


INSERT INTO temp_fabric_booking (style, pohead, headers, garment_break_down, finish_fabric, greige_fabric)
VALUES (
pstyle,

IFNULL(
(
SELECT REPLACE(
