CREATE DEFINER=`root`@`localhost` PROCEDURE `pget_fabric_entrys`(
IN `pid` int,
IN `pbuyer` varchar(100),
IN `porderNo` varchar(100),
IN `pstyle` varchar(100),
IN `pcolor` varchar(100),
IN `psize` varchar(100),
IN `pentry` int,
IN `porgId` int)
BEGIN

declare pworkorderId int;

if (pid = 0)
then
set pworkorderId = (select id from workorder 
where buyer = pbuyer and orderNo = porderNo and style =pstyle and color= pcolor and size = psize  and orgId = porgId and delStatus = 0);
else 
set pworkorderId = (select id from workorder where id = pid and orgId = porgId and delStatus = 0);
end if;

select id,buyer,orderNo,style,color,size,fabType, fabDia, fabGsm, yarnType, yarnCount, knitSL, spinFty, knitFty, dyeinFty, yarnLot, noRolls, status, isPrint, printCount from workorder 
where id = pworkorderId and orgId = porgId and delStatus = 0;

select id,workorderId,rollNo,fabBarcode,entry_1, entry_1At, entry_2, entry_2At, entry_3, entry_3At, entry_4, entry_4At, entry_5, entry_5At, entry_6, entry_6At, entry_7, entry_7At, reason, batchNo from fabric_roll 
where workorderId = pworkorderId and orgId = porgId and delStatus = 0 ;

select sum(entry_1) as entry_1,
sum(entry_2) as entry_2,
sum(entry_3) as entry_3,
sum(entry_4) as entry_4,
sum(entry_5) as entry_5,
sum(entry_6) as entry_6,
sum(entry_7) as entry_7 from fabric_roll 
where workorderId = pworkorderId and orgId = porgId and delStatus = 0 ;

Select count(id) as fabric_roll_total_count,
sum(case when entry_1 != 0 then 1 else 0 end) AS entry_1_count,
sum(case when entry_2 != 0 then 1 else 0 end) AS entry_2_count,
sum(case when entry_3 != 0 then 1 else 0 end) AS entry_3_count, 
sum(case when entry_4 != 0 then 1 else 0 end) AS entry_4_count,
sum(case when entry_5 != 0 then 1 else 0 end) AS entry_5_count,
sum(case when entry_6 != 0 then 1 else 0 end) AS entry_6_count,
sum(case when entry_7 != 0 then 1 else 0 end) AS entry_7_count  from fabric_roll 
where workorderId = pworkorderId and orgId = porgId and delStatus = 0 ;

END ;;
DELIMITER ;
