CREATE DEFINER=`root`@`localhost` PROCEDURE `pget_size_id_BO`( IN `psize` varchar(1000) ,IN `pcolor` varchar(1000),IN `pstyle` varchar(1000),IN `porder` varchar(1000) ,IN `pbuyer` varchar(1000) , IN `porgId` int)
BEGIN
SELECT 
sy.yarnType, 
sy.yarnTypeId, 
sy.fabricType, 
sy.fabricTypeId, 
sy.fabricGSM,
sy.dyeType ,
sy.dyeTypeId,
pml.*,
fsm.finishDia 
FROM po_master pm 
left join po_master_line pml  on pm.id = pml.orderId
left join styles sy on sy.style = pml.style and sy.buyer = pm.buyer
left join fsize_master fsm on fsm.style = pml.style and fsm.size = pml.size
WHERE
pm.delStatus = 0 and 
pm.orgId = porgId and 
pm.buyer = pbuyer and 
pml.orderNo = porder and 
pml.style = pstyle and 
pml.color = pcolor and 
pml.size = psize ;
END ;;
DELIMITER ;
