CREATE DEFINER=`root`@`localhost` PROCEDURE `pget_style_color_BO`( IN `pstyle` varchar(1000),IN `porder` varchar(1000) ,IN `pbuyer` varchar(1000) , IN `porgId` int)
BEGIN
    IF LENGTH(pstyle) = 0 THEN
SELECT distinct pml.style FROM po_master pm join po_master_line pml  on pm.id = pml.orderId
    WHERE pml.delStatus = 0 and pml.orgId = porgId and pm.buyer = pbuyer and pm.orderNo = porder;
    ELSE
SELECT distinct pml.color FROM po_master pm join po_master_line pml  on pm.id = pml.orderId
    WHERE pml.delStatus = 0 and pml.orgId = porgId and pm.buyer = pbuyer and pm.orderNo = porder and pml.style = pstyle;
    END IF;
END ;;
