CREATE DEFINER=`root`@`localhost` PROCEDURE `pknitfactoryinventory`(IN `pdate` date ,IN `porgId` int)
BEGIN
select 
buyer, 
orderNo, 
style, 
    color, 
    sum(greigeKg) as greigeKg ,
ANY_VALUE(factory) AS knitFty, 
    ANY_VALUE(date_format(createdAt , '%Y-%m-%d')) AS createdAt ,
    round(sum(Entry2)) as Entry2 , 
ANY_VALUE(date_format(production_date , '%Y-%m-%d')) AS production_date ,
    round(sum(allocatedYarnKgs),2) as allocatedYarnKgs , 
    round(sum(unallocatedYarnKgs),2) as unallocatedYarnKgs , 
ANY_VALUE(date_format(YoaCreatedAt , '%Y-%m-%d')) AS YoaCreatedAt ,
    round(sum(pendingReceiptKgs),2) as pendingReceiptKgs ,
    round(sum(receiptYarnKgs),2) as receiptYarnKgs ,
ANY_VALUE(date_format(receiptDt , '%Y-%m-%d')) AS receiptDt ,
round(sum(pendingReceiptKgs),2) as pendingReceiptKgs 
from 
(
SELECT  
    WO.buyer, 
    WO.orderNo,
    WO.style, 
    WO.color, 
    WO.greigeKg,
    ANY_VALUE(WO.createdAt) AS createdAt,
    ANY_VALUE(kn.factory) as factory ,
    ANY_VALUE(te2.entry_2) as Entry2 , 
ANY_VALUE(te2.production_date) as production_date , 
    ANY_VALUE(yoa.allocatedYarnKgs) as allocatedYarnKgs ,
ANY_VALUE(yoa.createdAt) as YoaCreatedAt ,
ANY_VALUE(yoa.unallocatedYarnKgs) as unallocatedYarnKgs , 
    ANY_VALUE(yrl.receiptYarnKgs) as receiptYarnKgs ,
    ANY_VALUE(yrl.receiptDt) as receiptDt ,
ANY_VALUE(yrl.pendingReceiptKgs) as pendingReceiptKgs
    
FROM 
    workorder WO 
JOIN
    (SELECT 
         k.factory,
         kl.buyer,
         kl.orderNo,
         kl.style,
         kl.color,
         kl.createdAt
     FROM 
         knit AS k 
     JOIN knit_line kl ON k.id = kl.knitId 
    ) AS kn
ON WO.buyer = kn.buyer AND WO.orderNo = kn.orderNo AND WO.style = kn.style AND WO.color = kn.color 

JOIN transcation_entry2 te2 on  WO.id = te2.workorderId 

JOIN yarn_order_allocations yoa on  WO.buyer = yoa.buyer and WO.orderNo = yoa.utilisationOrderNo and WO.style = yoa.style and WO.color = yoa.colour

join yarn_receipts_lines yrl on yoa.yarnId = yrl.yarnId

GROUP BY 
    WO.buyer, 
    WO.orderNo,
    WO.style, 
    WO.color, 
    WO.greigeKg 
) as knit 
where date_format(createdAt , '%Y-%m-%d')<= pdate and date_format(production_date , '%Y-%m-%d')<= pdate and date_format(YoaCreatedAt , '%Y-%m-%d')<= pdate and date_format(receiptDt , '%Y-%m-%d') <= pdate   
GROUP BY buyer, orderNo, style, color ; 
END ;;
DELIMITER ;
