CREATE DEFINER=`root`@`localhost` PROCEDURE `ppost_cutting`(
IN `pheaderQuery` longtext, 
IN `ploginId` int,
IN `porgId` int)
BEGIN

DECLARE loopid int;
DECLARE datacount int;
DECLARE pid int;

Drop temporary table if exists tmp_cutting;
CREATE temporary TABLE `tmp_cutting` (
`id` int(11) NOT NULL AUTO_INCREMENT,
    `line_id` int default null,
    `buyer` varchar(255) default null,
    `orderNo` varchar(255) default null,
    `style` varchar(255) default null,
    `color` varchar(255) default null,
    `size` varchar(255) default null,
    `woId` int default null,
    `cutDate` datetime default null,
    `batch` varchar(255) default null,
    `cutPcs` int default null,
    `rolls` int default null,
    `createdBy` int default null,
    `orgId` int default null,
    primary key(id)
);

IF(pheaderQuery <> '')THEN
SET @s1 = pheaderQuery;
PREPARE stmt1 FROM @s1;
EXECUTE stmt1 ;
DEALLOCATE PREPARE stmt1;
END IF; 

SET loopid = 1;
SET datacount = (select count(*) from tmp_cutting);
while(loopid <= datacount) DO
SET pid = (select line_id from tmp_cutting where id = loopid);
if (pid = 0) then
insert into cutting (buyer, orderNo, style, color, size, woId, batch, rolls, cutPcs, cutDate, orgId, createdBy, createdAt)
SELECT buyer, orderNo, style, color, size, woId, batch, rolls, cutpcs, cutDate, porgId, ploginId, now() from tmp_cutting where id = loopid and line_id = pid;
ELSE
UPDATE cutting a , tmp_cutting b SET 
a.woId = b.woId,
a.buyer = b.buyer,
a.orderNo = b.orderNo,
a.style = b.style, 
a.color = b.color, 
a.size = b.size, 
a.batch = b.batch, 
a.rolls = b.rolls, 
a.cutPcs = b.cutpcs,
a.cutDate = b.cutDate,
a.modifiedBy = ploginId,
a.modifiedAt = now()
WHERE 
a.id = pid AND b.line_id = pid AND a.orgId = porgId;
END IF;
SET loopid = loopid + 1;
END WHILE;
END ;;
