  `processloss` float default null,
  `createdBy` INT DEFAULT NULL,
  `orgId` INT DEFAULT NULL,
   PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

IF(pheaderQuery <> '')THEN
SET @s1 = pheaderQuery;
PREPARE stmt1 FROM @s1;
EXECUTE stmt1 ;
DEALLOCATE PREPARE stmt1;
END IF; 

if (pid = 0) then
if not exists (select id from dye where batchNo = pbatchNo and orgId = porgId) then
insert into dye (code,dyeFactory,buyer,orderNo,style,color,fabricType,softner,silicon,enzyme,batchNo,batchRemarks,batch_batchMakeDate,batch_batchRollsSLCheck,dyeing_loadDatetime,dyeing_unloadingDateTime,dyeing_totalRunTime,dyeing_receipeChart,shade_lapDipOriginalQTX,shade_masterBatchCheck,shade_dyeUnloadShadeCheck,shade_shadeSubmissionDate,shade_shadeApprovalDate,shade_firstBatchNotOkReason,squeezer_squeezerDateTime,squeezer_rpmValue,squeezer_trolleyPlate,squeezer_overfeedValue,squeezer_padderPressureValue,squeezer_shape,squeezer_backAngle,dryer_dryerDatetime,dryer_temperatureValue,dryer_rpmValue,dryer_overfeedValue,calendar_rpmValue,calendar_steamHighLow,slitting_slittingDatetime,slitting_DTwister,slitting_trolleyPlate,stenter_stenterDatetime,stenter_temperatureValue,stenter_overfeedValue,stenter_diasettingValue,stenter_softnerSiliconUsage,compact_openCompactDatetime,compact_rpmValue,compact_overfeedValue,compact_diasettingValue,compact_steamHighLow,tubtex_tubtexDatetime,tubtex_yarnLot,tubtex_overfeedValue,tubtex_steamHighLow,tubtex_rollerKnifeSetting,tubtex_sideLoosePileCheck,tubtex_diaGSMCheck,tubtex_shadeLightBoxDataColor,finalbatch_shrinkageTwistingReport,finalbatch_GSMReport,finalbatch_rollRollShadeCheck,finalbatch_rubbingReportWetDry,finalbatch_phReportInhouseCheck,finalbatch_phenolicYellowingTest,finalbatch_qcInspectionReport,finalbatch_batchRollsWeight,finalbatch_finishRollsWeight,finalbatch_processLoss,finalbatch_fabricDeliveryDatetime,orgId,createdBy,createdAt) values 
(fn_getCodeGen('DYE',porgId),pdyeFactory,pbuyer,porderNo,pstyle,pcolor,pfabricType,psoftner,psilicon,penzyme,pbatchNo,pbatchRemarks,pbatch_batchMakeDate,pbatch_batchRollsSLCheck,pdyeing_loadDatetime,pdyeing_unloadingDateTime,pdyeing_totalRunTime,pdyeing_receipeChart,pshade_lapDipOriginalQTX,pshade_masterBatchCheck,pshade_dyeUnloadShadeCheck,pshade_shadeSubmissionDate,pshade_shadeApprovalDate,pshade_firstBatchNotOkReason,psqueezer_squeezerDateTime,psqueezer_rpmValue,psqueezer_trolleyPlate,psqueezer_overfeedValue,psqueezer_padderPressureValue,psqueezer_shape,psqueezer_backAngle,pdryer_dryerDatetime,pdryer_temperatureValue,pdryer_rpmValue,pdryer_overfeedValue,pcalendar_rpmValue,pcalendar_steamHighLow,pslitting_slittingDatetime,pslitting_DTwister,pslitting_trolleyPlate,pstenter_stenterDatetime,pstenter_temperatureValue,pstenter_overfeedValue,pstenter_diasettingValue,pstenter_softnerSiliconUsage,pcompact_openCompactDatetime,pcompact_rpmValue,pcompact_overfeedValue,pcompact_diasettingValue,pcompact_steamHighLow,ptubtex_tubtexDatetime,ptubtex_yarnLot,ptubtex_overfeedValue,ptubtex_steamHighLow,ptubtex_rollerKnifeSetting,ptubtex_sideLoosePileCheck,ptubtex_diaGSMCheck,ptubtex_shadeLightBoxDataColor,pfinalbatch_shrinkageTwistingReport,pfinalbatch_GSMReport,pfinalbatch_rollRollShadeCheck,pfinalbatch_rubbingReportWetDry,pfinalbatch_phReportInhouseCheck,pfinalbatch_phenolicYellowingTest,pfinalbatch_qcInspectionReport,pfinalbatch_batchRollsWeight,pfinalbatch_finishRollsWeight,pfinalbatch_processLoss,pfinalbatch_fabricDeliveryDatetime,porgId,ploginId,now());

set pheaderId = (SELECT LAST_INSERT_ID());

set loopid = 1;
set datacount = (select count(*) from tmp_dye_line);
while(loopid <= datacount) do
insert into dye_line (dyeId,size,woId,greigerolls,griege,finishrolls,finish,difference,processloss,orgId,createdBy,createdAt)
select pheaderId,size,woId,greigeRolls,griege,finishRolls,finish,difference,processloss,orgId,createdBy,now() from tmp_dye_line where id = loopid;

set pdye_lineId =  (SELECT LAST_INSERT_ID());

INSERT INTO transcation_entry3 (workorderId, batchCode, notes, production_date, noOfRolls, entry_3, entry_3At, createdBy, createdAt, dye_lineId, dyeId, orgId)
select tmp.woId, pbatchNo, pdyeFactory, pbatch_batchMakeDate, tmp.greigeRolls, tmp.griege, now(), ploginId, now(), pdye_lineId, pheaderId, porgId from tmp_dye_line tmp where id = loopid;

INSERT INTO transcation_entry4 (workorderId, batchCode, notes, production_date, noOfRolls, entry_4, entry_4At, createdBy, createdAt, dye_lineId, dyeId, orgId)
select tmp.woId, pbatchNo, pdyeFactory, pbatch_batchMakeDate, tmp.finishRolls, tmp.finish, now(), ploginId, now(), pdye_lineId, pheaderId, porgId from tmp_dye_line tmp where id = loopid;
set loopid = loopid + 1;
