else 
if not exists (select id from dye where batchNo = pbatchNo and orgId =porgId and id <> pid) then

update dye set 
dyeFactory = pdyeFactory,
buyer = pbuyer,
orderNo = porderNo,
style = pstyle,
color = pcolor,
fabricType = pfabricType,
softner = psoftner,
