tubtex_sideLoosePileCheck = ptubtex_sideLoosePileCheck,
tubtex_diaGSMCheck = ptubtex_diaGSMCheck,
tubtex_shadeLightBoxDataColor = ptubtex_shadeLightBoxDataColor,
finalbatch_shrinkageTwistingReport = pfinalbatch_shrinkageTwistingReport,
finalbatch_GSMReport = pfinalbatch_GSMReport,
finalbatch_rollRollShadeCheck = pfinalbatch_rollRollShadeCheck,
finalbatch_rubbingReportWetDry = pfinalbatch_rubbingReportWetDry,
finalbatch_phReportInhouseCheck = pfinalbatch_phReportInhouseCheck,
finalbatch_phenolicYellowingTest = pfinalbatch_phenolicYellowingTest,
finalbatch_qcInspectionReport = pfinalbatch_qcInspectionReport,
finalbatch_batchRollsWeight = pfinalbatch_batchRollsWeight,
finalbatch_finishRollsWeight = pfinalbatch_finishRollsWeight,
finalbatch_processLoss = pfinalbatch_processLoss,
finalbatch_fabricDeliveryDatetime = pfinalbatch_fabricDeliveryDatetime,
modifiedBy = ploginId,
modifiedAt = now()
where id = pid and orgId = porgId;

if(pheaderQuery != '') then
SET loopid = 1;
SET datacount = (select Count(*) from tmp_dye_line);

WHILE (loopid <= datacount) DO 
