IF (pline_id = 0) then
insert into dye_line (dyeId,size,woId,greigerolls,griege,finishrolls,finish,difference,processloss,orgId,createdBy,createdAt)
select pid,size,woId,greigeRolls,griege,finishRolls,finish,difference,processloss,orgId,createdBy,now() from tmp_dye_line where line_id = pline_id;

INSERT INTO transcation_entry3 (workorderId, batchCode, production_date, noOfRolls, entry_3, entry_3At, createdBy, createdAt, dye_lineId, dyeId, orgId)
select tmp.woId, pbatchNo, pbatch_batchMakeDate, tmp.greigeRolls, tmp.griege, now(), ploginId, now(), tmp.line_id, pid, porgId from tmp_dye_line tmp where line_id = pline_id;

INSERT INTO transcation_entry4 (workorderId, batchCode, production_date, noOfRolls, entry_4, entry_4At, createdBy, createdAt, dye_lineId, dyeId, orgId)
select tmp.woId, pbatchNo, pbatch_batchMakeDate, tmp.finishRolls, tmp.finish, now(), ploginId, now(), tmp.line_id, pid, porgId from tmp_dye_line tmp where line_id = pline_id;


ELSE 
UPDATE dye_line dl, tmp_dye_line tdl set 
dl.size = tdl.size,
dl.woId = tdl.woId,
dl.greigerolls = tdl.greigeRolls,
dl.griege = tdl.griege,
dl.finishrolls = tdl.finishRolls,
dl.finish = tdl.finish,
dl.difference = tdl.difference,
dl.processloss = tdl.processloss
where dl.id = tdl.line_id and dl.dyeId = tdl.dyeId AND tdl.id = loopid;

update transcation_entry3 ent3, tmp_dye_line tdl set 
ent3.workorderId = tdl.woId, 
ent3.batchCode = pbatchNo, 
ent3.noOfRolls = tdl.greigeRolls,
ent3.entry_3 = tdl.griege,
ent3.entry_3At = now(),
ent3.modifiedBy = ploginId,
ent3.modifiedAt = now()
where ent3.dyeId = tdl.dyeId and ent3.dye_lineId = pline_id and tdl.id = loopid;

update transcation_entry4 ent4, tmp_dye_line tdl set 
ent4.workorderId = tdl.woId, 
ent4.batchCode = pbatchNo, 
ent4.noOfRolls = tdl.finishRolls,
ent4.entry_4 = tdl.finish,
ent4.entry_4At = now(),
ent4.modifiedBy = ploginId,
ent4.modifiedAt = now()
where ent4.dyeId = tdl.dyeId and ent4.dye_lineId = pline_id and tdl.id = loopid;

END IF;
COMMIT;
SET loopid = loopid + 1; 
END WHILE;
end if;

END IF;
END IF;
END ;;
