CREATE DEFINER=`root`@`localhost` PROCEDURE `ppost_dyeWorkOrder`(
    IN `pid` int(11),
    IN `pdyefty` varchar(225),
    IN `pdyefty_details` VARCHAR(1000),
    IN `pbuyer` varchar(255),
    IN `porderNo` varchar(255),
    IN `pwoNo` VARCHAR(255),
    IN `pwoRefNo` VARCHAR(255),
    IN `pwoDate` datetime,
    IN `pcompletedDate` datetime,
    IN `pdyeKgs` INT,
    IN `pdyeValue` INT,
    IN `pnotes` longtext,
    IN `pheaderQuery` longtext,
    IN `ploginId` int,
    IN `porgId` int)
BEGIN
    DECLARE datacount INT;
    DECLARE loopid INT;
    DECLARE pheaderId INT;
    DECLARE pline_id INT;

    
    DROP TEMPORARY TABLE IF EXISTS tmp_dyewo_line;

    
    CREATE TEMPORARY TABLE `tmp_dyewo_line` ( 
        `id` int(11) NOT NULL AUTO_INCREMENT,
        `line_id` int,
        `dyeWoId` int DEFAULT NULL,
        `machDia` varchar(255),
        `fabDia` varchar(255),
        `fabType` varchar(255),
        `style` varchar(100) DEFAULT NULL,
        `color` varchar(100) DEFAULT NULL,
        `fabGSM` varchar(100) DEFAULT NULL,
        `pl` varchar(255),
        `greigeKg` int,
        `dyeRate` int,
        `dyeValue` int,
        `remarks` text DEFAULT NULL,
        `createdBy` INT DEFAULT NULL,
        `orgId` INT DEFAULT NULL,
        PRIMARY KEY (`id`)
    ) ENGINE=InnoDB DEFAULT CHARSET=utf8;

    
    IF (pheaderQuery <> '') THEN
        SET @s1 = pheaderQuery;
        PREPARE stmt1 FROM @s1;
        EXECUTE stmt1;
        DEALLOCATE PREPARE stmt1;
    END IF; 

    
    IF (pid = 0) THEN
        
        INSERT INTO dyeworkorder (dyefty, dyefty_details, buyer, orderNo, woNo, woRefNo, woDate, completedDate, dyeKgs, dyeValue, notes, orgId, createdBy) 
        VALUES (pdyefty, pdyefty_details, pbuyer, porderNo, pwoNo, pwoRefNo, pwoDate, pcompletedDate, pdyeKgs, pdyeValue, pnotes, porgId, ploginId);

        
        SET pheaderId = LAST_INSERT_ID();

        
        INSERT INTO dyeworkorder_line (dyeWoId, machDia, fabDia, fabType, style, color, fabGSM, pl, greigeKg, dyeRate, dyeValue, remarks, orgId, createdBy)
        SELECT pheaderId, machDia, fabDia, fabType, style, color, fabGSM, pl, greigeKg, dyeRate, dyeValue, remarks, orgId, createdBy FROM tmp_dyewo_line;

    ELSE 
        
        UPDATE dyeworkorder 
        SET 
            dyefty = pdyefty,
            dyefty_details = pdyefty_details,
            buyer = pbuyer,
            orderNo = porderNo,
            woNo = pwoNo,
            woRefNo = pwoRefNo,
            woDate = pwoDate,
            completedDate = pcompletedDate,
            dyeKgs = pdyeKgs,
            dyeValue = pdyeValue,
            notes = pnotes,
            modifiedBy = ploginId,
            modifiedAt = NOW()
        WHERE id = pid AND orgId = porgId;

        
        IF (pheaderQuery <> '') THEN
            SET loopid = 1;
            SET datacount = (SELECT COUNT(*) FROM tmp_dyewo_line);

            WHILE (loopid <= datacount) DO 
                SET pline_id = (SELECT line_id FROM tmp_dyewo_line WHERE id = loopid AND orgId = porgId);

                IF (pline_id = 0) THEN
                    INSERT INTO dyeworkorder_line (dyeWoId, machDia, fabDia, fabType, style, color, fabGSM, pl, greigeKg, dyeRate, dyeValue, remarks, orgId, createdBy)
                    SELECT pid, machDia, fabDia, fabType, style, color, fabGSM, pl, greigeKg, dyeRate, dyeValue, remarks, orgId, createdBy 
                    FROM tmp_dyewo_line 
                    WHERE id = loopid;
                ELSE 
                    UPDATE dyeworkorder_line kl
                    JOIN tmp_dyewo_line tkl ON kl.id = pline_id
                    SET 
                        kl.machDia = tkl.machDia,
                        kl.fabDia = tkl.fabDia,
                        kl.style = tkl.style,
                        kl.color = tkl.color,
                        kl.fabType = tkl.fabType,
                        kl.fabGSM = tkl.fabGSM,
                        kl.pl = tkl.pl,
                        kl.greigeKg = tkl.greigeKg,
                        kl.dyeRate = tkl.dyeRate,
                        kl.dyeValue = tkl.dyeValue,
                        kl.remarks = tkl.remarks
                    WHERE kl.dyeWoId = pid AND tkl.id = loopid AND tkl.orgId = porgId;
                END IF;

                SET loopid = loopid + 1; 
            END WHILE;
        END IF;
    END IF;
END ;;
