CREATE DEFINER=`root`@`localhost` PROCEDURE `ppost_dye_delivery`(
IN `pid` int(11),
IN `pfactory` varchar(225),
IN `pdate` datetime,
IN `pheaderQuery` longtext,
IN `ploginId` int,
IN `porgId` int)
BEGIN


DECLARE datacount INT;
DECLARE datacount2 int;
DECLARE loopid INT;
DECLARE loopid2 INT;
DECLARE pheaderId INT;
DECLARE pline_id INT;
DECLARE pline_id2 INT;
DECLARE pdyedelline_id int;
declare pdyedelline2_id INT;

Drop temporary table if exists tmp_dye_delivery_line;
CREATE temporary TABLE `tmp_dye_delivery_line` ( 
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `line_id` int default 0,
  `dyeDelId` int DEFAULT NULL,
  `dyeChallan` varchar(100) default null,
  `buyer` varchar(100) DEFAULT NULL,
  `orderNo` varchar(100) DEFAULT NULL,
  `style` varchar(100) DEFAULT NULL,
  `color` varchar(100) DEFAULT NULL,
  `size` varchar(100) DEFAULT NULL,
  `woId` int,
  `batchNo` varchar(100) default null,
  `griegeRolls` int default null,
  `griegeDeliveryKgs` float default null,
  `finishRolls` int default null,
  `finishDeliveryKgs` float default null,
  `dyeRate` float DEFAULT NULL,
  `dyeValue` float DEFAULT NULL,
  `createdBy` INT DEFAULT NULL,
  `orgId` INT DEFAULT NULL,
   PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

IF(pheaderQuery <> '')THEN
SET @s1 = pheaderQuery;
PREPARE stmt1 FROM @s1;
EXECUTE stmt1 ;
DEALLOCATE PREPARE stmt1;
END IF; 

if (pid = 0) then
insert into dye_delivery (factory,date,totalfinishrolls,totalfinishKg,rollgriegeTotal,deliveryGriegeTotal,dyeValueTotal,orgId,createdBy,createdAt)
select pfactory,pdate, sum(finishRolls),sum(finishDeliveryKgs),sum(griegeRolls), sum(griegeDeliveryKgs),sum(dyeValue),porgId,ploginId,now() from tmp_dye_delivery_line;
set pheaderId = (SELECT LAST_INSERT_ID());

IF(pheaderQuery <> '')THEN
    SET loopid2 = 1;
    SET datacount2 = (SELECT COUNT(*) FROM tmp_dye_delivery_line);
    WHILE (loopid2 <= datacount2) DO 
insert into dye_delivery_line (dyeDelId,dyeChallan,buyer,orderNo,style,color,size,woId,batchNo,griegeRolls,griegeDeliveryKgs,finishRolls,finishDeliveryKgs,dyeRate,dyeValue,orgId,createdBy,createdAt)
select pheaderId,tmp.dyeChallan,tmp.buyer,tmp.orderNo,tmp.style,tmp.color,tmp.size,tmp.woId,tmp.batchNo,tmp.griegeRolls,tmp.griegeDeliveryKgs,tmp.finishRolls,tmp.finishDeliveryKgs,tmp.dyeRate,tmp.dyeValue,porgId,ploginId,now() from tmp_dye_delivery_line tmp WHERE tmp.id = loopid2;
set pdyedelline_id = (SELECT LAST_INSERT_ID());
        INSERT INTO transcation_entry5 (dyeDelId, dyedelline_id, workorderId, batchCode, production_date, griegeRolls, griegeKgs, noOfRolls, entry_5, entry_5At, notes, createdBy, createdAt, orgId)
        SELECT pheaderId, pdyedelline_id, tfr.woId, tfr.batchNo,pdate, tfr.griegeRolls, tfr.griegeDeliveryKgs, tfr.finishRolls, tfr.finishDeliveryKgs, NOW(), pfactory, ploginId, NOW(), porgId FROM tmp_dye_delivery_line tfr WHERE tfr.id = loopid2;
        COMMIT;
        SET loopid2 = loopid2 + 1; 
    END WHILE;
END IF;
ELSE 
UPDATE dye_delivery kd
JOIN (SELECT SUM(griegeRolls) AS griegetotalRolls, SUM(griegeDeliveryKgs) AS griegetotalKg, sum(finishRolls) as finishtotalrolls, sum(finishDeliveryKgs) as finishtotalkgs, sum(dyeValue) as totalDyeValue FROM tmp_dye_delivery_line) tmp ON 1=1
SET 
    kd.factory = pfactory,
    kd.date = pdate,
    kd.totalfinishrolls = tmp.finishtotalrolls,
    kd.totalfinishKg = tmp.finishtotalkgs,
    kd.rollgriegeTotal = tmp.griegetotalRolls,
    kd.deliveryGriegeTotal = tmp.griegetotalKg,
    kd.dyeValueTotal = tmp.totalDyeValue,
    kd.modifiedBy = ploginId,
    kd.modifiedAt = NOW()
WHERE 
    kd.id = pid 
    AND kd.orgId = porgId;

IF(pheaderQuery <> '')THEN
SET loopid = 1;
SET datacount = (select Count(*) from tmp_dye_delivery_line);

WHILE (loopid <= datacount) DO 
set pline_id = (select line_id from tmp_dye_delivery_line where id = loopid and orgId = porgId);

IF (pline_id = 0) then
insert into dye_delivery_line (dyeDelId,dyeChallan,buyer,orderNo,style,color,size,woId,batchNo,griegeRolls,griegeDeliveryKgs,finishRolls,finishDeliveryKgs,dyeRate,dyeValue,orgId,createdBy,createdAt)
select tmp.dyeDelId,tmp.dyeChallan,tmp.buyer,tmp.orderNo,tmp.style,tmp.color,tmp.size,tmp.woId,tmp.batchNo,tmp.griegeRolls,tmp.griegeDeliveryKgs,tmp.finishRolls,tmp.finishDeliveryKgs,tmp.dyeRate,tmp.dyeValue,porgId,ploginId,now() from tmp_dye_delivery_line tmp WHERE tmp.line_id = pline_id;
set pdyedelline2_id = (SELECT LAST_INSERT_ID());
INSERT INTO transcation_entry5 (dyeDelId,dyedelline_id, workorderId, batchCode,production_date, griegeRolls, griegeKgs, noOfRolls, entry_5, entry_5At, notes, createdBy, createdAt, orgId)
SELECT tfr.dyeDelId, pdyedelline_id, tfr.woId, tfr.batchNo,pdate, tfr.griegeRolls, tfr.griegeDeliveryKgs, tfr.finishRolls, tfr.finishDeliveryKgs, NOW(), pfactory, ploginId, NOW(), porgId FROM tmp_dye_delivery_line tfr WHERE tfr.line_id = pline_id;

ELSE 
UPDATE dye_delivery_line kl, tmp_dye_delivery_line tkl set 
kl.dyeChallan = tkl.dyeChallan,
kl.buyer = tkl.buyer,
kl.orderNo = tkl.orderNo,
kl.style = tkl.style,
kl.color = tkl.color,
kl.size = tkl.size,
kl.woId = tkl.woId,
kl.batchNo = tkl.batchNo,
kl.griegeRolls = tkl.griegeRolls,
kl.griegeDeliveryKgs =tkl.griegeDeliveryKgs,
kl.finishRolls = tkl.finishRolls,
kl.finishDeliveryKgs = tkl.finishDeliveryKgs,
kl.dyeRate = tkl.dyeRate,
kl.dyeValue = tkl.dyeValue
where kl.id = pline_id and kl.dyeDelId = tkl.dyeDelId and tkl.id= loopid;

UPDATE transcation_entry5 ent1, tmp_dye_delivery_line tkl SET 
    ent1.workorderId = tkl.woId,
    ent1.production_date = pdate,
    ent1.griegeRolls = tkl.griegeRolls,
    ent1.griegeKgs = tkl.griegeDeliveryKgs,
    ent1.noOfRolls = tkl.finishRolls,
    ent1.entry_5 = tkl.finishDeliveryKgs,
    ent1.batchCode = tkl.batchNo,
    ent1.notes = pfactory,
    ent1.entry_5At = NOW(),
    ent1.modifiedBy = ploginId,
    ent1.modifiedAt = NOW()
WHERE ent1.dyedelline_id = pline_id AND ent1.dyeDelId = tkl.dyeDelId;

END IF;
COMMIT;
SET loopid = loopid + 1; 
END WHILE;
END IF;
END IF;
END ;;
DELIMITER ;
