CREATE DEFINER=`root`@`localhost` PROCEDURE `ppost_fabrictransfer`(
    IN `pfabricQuery` LONGTEXT,
    IN `ploginId` INT,
    IN `porgId` INT
)
BEGIN
    DECLARE datacount INT;
    DECLARE loopid INT;
    DECLARE lineId INT;

    DROP TEMPORARY TABLE IF EXISTS tmp_fab_entry;
    CREATE TEMPORARY TABLE `tmp_fab_entry` (
        `id` INT(11) NOT NULL AUTO_INCREMENT,
        `fabId` int default null,
        `buyer` varchar(255) default null,
        `orderNo` varchar(255) default null,
        `style` varchar(255) default null,
        `color` varchar(255) default null,
        `size` varchar(255) default null,
`transferNo` varchar(100) default null,
        `transferDate` datetime default null,
        `woId` INT DEFAULT NULL,
        `fabRolls` INT DEFAULT NULL,
        `finishFabKg` float DEFAULT NULL,
        `createdBy` INT DEFAULT NULL,
        `orgId` INT DEFAULT NULL,
        PRIMARY KEY (`id`)
    ) ENGINE=InnoDB DEFAULT CHARSET=utf8;

    IF(pfabricQuery <> '') THEN
        SET @s1 = pfabricQuery;
        PREPARE stmt1 FROM @s1;
        EXECUTE stmt1;
        DEALLOCATE PREPARE stmt1;
    END IF;

    IF(pfabricQuery != '') THEN
        SET loopid = 1;
        SET datacount = (select Count(*) from tmp_fab_entry);
        WHILE (loopid <= datacount) DO 
        SET lineId = (select fabId from tmp_fab_entry where id=loopid and orgId = porgId);
IF (lineId <> 0) THEN
            UPDATE fabrictransfer fr, tmp_fab_entry tfr
                SET fr.transferno = tfr.transferNo,
fr.transfer_date = tfr.transferDate,
                    fr.buyer = tfr.buyer, 
                    fr.orderNo = tfr.orderNo,
                    fr.style = tfr.style,
                    fr.color = tfr.color,
                    fr.size = tfr.size,
                    fr.woId = tfr.woId,
                    fr.rollNo = tfr.fabRolls,
                    fr.finishKg = tfr.finishFabKg,
                    fr.modifiedAt = now(),
                    fr.modifiedBy = ploginId
                    where fr.id = tfr.fabId
                    AND fr.orgId = tfr.orgId;

                ELSE
                INSERT INTO fabrictransfer (transferno, transfer_date, buyer, orderNo, style, color, size, woId, rollNo, finishKg, createdBy, createdAt, orgId)
SELECT tfr.transferNo, tfr.transferDate, tfr.buyer, tfr.orderNo, tfr.style, tfr.color, tfr.size, tfr.woId, tfr.fabRolls, tfr.finishFabKg, ploginId, now(), tfr.orgId from tmp_fab_entry tfr where id=loopid;
                
                END IF;
COMMIT;
SET loopid = loopid + 1;
                END WHILE;
            END IF;
END ;;
