CREATE DEFINER=`root`@`localhost` PROCEDURE `ppost_knit`(
IN `pid` int(11),
IN `pfactory` varchar(225),
IN `pdate` datetime,
IN `pallocatedDay` int(11),
IN `phouseKeepingStatus` varchar(45),
IN `pfloorLightingStatus` varchar(45),
IN `pgasElecAvailability` varchar(45),
IN `pstorageAreaStatus` varchar(45),
IN `pknitstatus` varchar(225),
IN `pheaderQuery` longtext,
IN `ploginId` int,
IN `porgId` int)
BEGIN


DECLARE datacount INT;
DECLARE datacount2 int;
DECLARE loopid INT;
DECLARE loopid2 INT;
DECLARE pheaderId INT;
DECLARE pline_id INT;
DECLARE pline_id2 INT;
DECLARE pknitline_id int;

Drop temporary table if exists tmp_knit_line;
CREATE temporary TABLE `tmp_knit_line` ( 
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `line_id` int,
  `knitId` int DEFAULT NULL,
  `buyer` varchar(100) DEFAULT NULL,
  `orderNo` varchar(100) DEFAULT NULL,
  `style` varchar(100) DEFAULT NULL,
  `color` varchar(100) DEFAULT NULL,
  `size` varchar(100) DEFAULT NULL,
  `woId` int,
  `knitMachineno` varchar(45) DEFAULT NULL,
  `yarnLot` varchar(45) DEFAULT NULL,
  `dayProductionKgs` varchar(45) DEFAULT NULL,
  `noOfRollsProduced` varchar(45) DEFAULT NULL,
  `noOfRollsChecked` varchar(45) DEFAULT NULL,
  `knittingSL` varchar(45) DEFAULT NULL,
  `machineRPM` varchar(45) DEFAULT NULL,
  `oilSystem` varchar(45) DEFAULT NULL,
  `yarnTension` varchar(45) DEFAULT NULL,
  `needleQuality` varchar(45) DEFAULT NULL,
  `sinkerQuality` varchar(45) DEFAULT NULL,
  `movingFan` varchar(45) DEFAULT NULL,
  `allStopMotion` varchar(45) DEFAULT NULL,
  `takeupRollerTension` varchar(45) DEFAULT NULL,
  `remarks` text DEFAULT NULL,
  `knitstatus` varchar(45) DEFAULT NULL,
  `createdBy` INT DEFAULT NULL,
  `orgId` INT DEFAULT NULL,
   PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

IF(pheaderQuery <> '')THEN
SET @s1 = pheaderQuery;
PREPARE stmt1 FROM @s1;
EXECUTE stmt1 ;
DEALLOCATE PREPARE stmt1;
END IF; 


if (pid = 0) then
insert into knit (code,factory,allocatedDay,date,houseKeepingStatus,floorLightingStatus,gasElecAvailability,storageAreaStatus,knitstatus,orgId,createdBy,createdAt) values 
(fn_getCodeGen('KN',porgId),pfactory,pallocatedDay,pdate,phouseKeepingStatus,pfloorLightingStatus,pgasElecAvailability,pstorageAreaStatus,pknitstatus,porgId,ploginId,now());
set pheaderId = (SELECT LAST_INSERT_ID());


IF(pheaderQuery <> '') THEN
    SET loopid2 = 1;
    SET datacount2 = (SELECT COUNT(*) FROM tmp_knit_line);
    WHILE (loopid2 <= datacount2) DO 
    
insert into knit_line (knitId,buyer,orderNo,style,color,size,woId,knitMachineno,yarnLot,dayProductionKgs,noOfRollsProduced,noOfRollsChecked,knittingSL,machineRPM,oilSystem,yarnTension,needleQuality,sinkerQuality,movingFan,allStopMotion,takeupRollerTension,remarks,knitstatus,orgId,createdBy,createdAt)
select pheaderId,buyer,orderNo,style,color,size,woId,knitMachineno,yarnLot,dayProductionKgs,noOfRollsProduced,noOfRollsChecked,knittingSL,machineRPM,oilSystem,yarnTension,needleQuality,sinkerQuality,movingFan,allStopMotion,takeupRollerTension,remarks,pknitstatus,orgId,createdBy,now() from tmp_knit_line  WHERE id = loopid2;

set pknitline_id = (SELECT LAST_INSERT_ID());

        INSERT INTO transcation_entry1 (knitId, knit_lineId, workorderId, production_date, noOfRolls, entry_1, entry_1At, notes, createdBy, createdAt, orgId)
        SELECT pheaderId, pknitline_id, tfr.woId, pdate, tfr.noOfRollsProduced, tfr.dayProductionKgs, NOW(), pfactory,ploginId, NOW(), porgId FROM tmp_knit_line tfr WHERE id = loopid2;
        COMMIT;
        SET loopid2 = loopid2 + 1; 
    END WHILE;
END IF;

else 

update knit set 
factory = pfactory,
allocatedDay = pallocatedDay,
date = pdate,
houseKeepingStatus = phouseKeepingStatus,
floorLightingStatus = pfloorLightingStatus,
gasElecAvailability = pgasElecAvailability,
storageAreaStatus = pstorageAreaStatus,
knitstatus = pknitstatus,
modifiedBy = ploginId,
modifiedAt = now()
where id = pid and orgId = porgId;


if(pheaderQuery != '') then
SET loopid = 1;
SET datacount = (select Count(*) from tmp_knit_line);

WHILE (loopid <= datacount) DO 
set pline_id = (select line_id from tmp_knit_line where id = loopid and orgId = porgId);

IF (pline_id = 0) then
INSERT INTO knit_line (knitId,buyer,orderNo,style,color,size,woId,knitMachineno,yarnLot,dayProductionKgs,noOfRollsProduced,noOfRollsChecked,knittingSL,machineRPM,oilSystem,yarnTension,needleQuality,sinkerQuality,movingFan,allStopMotion, takeupRollerTension,remarks,knitstatus,orgId,createdBy,createdAt)
SELECT pheaderId,buyer,orderNo,style,color,size,woId,knitMachineno,yarnLot,dayProductionKgs,noOfRollsProduced,noOfRollsChecked,knittingSL,machineRPM,oilSystem,yarnTension,needleQuality,sinkerQuality,movingFan,allStopMotion,takeupRollerTension,remarks,pknitstatus,orgId,createdBy,now() from tmp_knit_line where id = loopid;

ELSE 
UPDATE knit_line kl, tmp_knit_line tkl set 
kl.buyer = tkl.buyer,
kl.orderNo = tkl.orderNo,
kl.style = tkl.style,
kl.color = tkl.color,
kl.size = tkl.size,
kl.woId = tkl.woId,
kl.knitMachineno = tkl.knitMachineno,
kl.yarnLot = tkl.yarnLot,
kl.dayProductionKgs = tkl.dayProductionKgs,
kl.noOfRollsProduced = tkl.noOfRollsProduced,
kl.noOfRollsChecked = tkl.noOfRollsChecked,
kl.knittingSL = tkl.knittingSL,
kl.machineRPM = tkl.machineRPM,
kl.oilSystem = tkl.oilSystem,
kl.yarnTension = tkl.yarnTension,
kl.needleQuality = tkl.needleQuality,
kl.sinkerQuality = tkl.sinkerQuality,
kl.movingFan = tkl.movingFan,
kl.allStopMotion = tkl.allStopMotion,
kl.takeupRollerTension = tkl.takeupRollerTension,
kl.remarks = tkl.remarks,
kl.knitstatus = pknitstatus
where kl.id = pline_id and kl.knitId = tkl.knitId and tkl.id= loopid;

UPDATE transcation_entry1 ent1, tmp_knit_line tkl SET 
    ent1.workorderId = tkl.woId,
    ent1.production_date = pdate,
    ent1.noOfRolls = tkl.noOfRollsProduced,
    ent1.entry_1 = tkl.dayProductionKgs,
    ent1.notes = pfactory,
    ent1.entry_1At = NOW(),
    ent1.modifiedBy = ploginId,
    ent1.modifiedAt = NOW()
WHERE ent1.knit_lineId = pline_id AND ent1.knitId = tkl.knitId;

END IF;
COMMIT;
SET loopid = loopid + 1; 
END WHILE;
END IF;
END IF;
END ;;
DELIMITER ;
