CREATE DEFINER=`root`@`localhost` PROCEDURE `ppost_knit_delivery`(
IN `pid` int(11),
IN `pfactory` varchar(225),
IN `pdate` datetime,
IN `pheaderQuery` longtext,
IN `ploginId` int,
IN `porgId` int)
BEGIN


DECLARE datacount INT;
DECLARE datacount2 int;
DECLARE loopid INT;
DECLARE loopid2 INT;
DECLARE pheaderId INT;
DECLARE pline_id INT;
DECLARE pline_id2 INT;
DECLARE pknitdelline_id int;
declare pknitdelline2_id INT;

Drop temporary table if exists tmp_knit_delivery_line;
CREATE temporary TABLE `tmp_knit_delivery_line` ( 
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `line_id` int default 0,
  `knitDelId` int DEFAULT NULL,
  `dyeFactory` varchar(100) default null,
  `knitChallan` varchar(100) default null,
  `scandexChallan` varchar(100) default null,
  `buyer` varchar(100) DEFAULT NULL,
  `orderNo` varchar(100) DEFAULT NULL,
  `style` varchar(100) DEFAULT NULL,
  `color` varchar(100) DEFAULT NULL,
  `size` varchar(100) DEFAULT NULL,
  `woId` int,
  `deliveryKgs` varchar(45) DEFAULT NULL,
  `noOfRolls` varchar(45) DEFAULT NULL,
  `knitRate` float DEFAULT NULL,
  `knitValue` float DEFAULT NULL,
  `createdBy` INT DEFAULT NULL,
  `orgId` INT DEFAULT NULL,
   PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

IF(pheaderQuery <> '')THEN
SET @s1 = pheaderQuery;
PREPARE stmt1 FROM @s1;
EXECUTE stmt1 ;
DEALLOCATE PREPARE stmt1;
END IF; 


if (pid = 0) then
insert into knit_delivery (factory,date,totalrolls,totalKg,orgId,createdBy,createdAt)
select pfactory,pdate, sum(noOfRolls), sum(deliveryKgs),porgId,ploginId,now() from tmp_knit_delivery_line;
set pheaderId = (SELECT LAST_INSERT_ID());

IF(pheaderQuery <> '')THEN
    SET loopid2 = 1;
    SET datacount2 = (SELECT COUNT(*) FROM tmp_knit_delivery_line);
    WHILE (loopid2 <= datacount2) DO 
insert into knit_delivery_line (knitDelId,dyeFactory,knitChallan,scandexChallan,buyer,orderNo,style,color,size,woId,noOfRolls,deliveryKgs,knitRate,knitValue,orgId,createdBy,createdAt)
select pheaderId,tmp.dyeFactory,tmp.knitChallan,tmp.scandexChallan,tmp.buyer,tmp.orderNo,tmp.style,tmp.color,tmp.size,tmp.woId,tmp.noOfRolls,tmp.deliveryKgs,tmp.knitRate,tmp.knitValue,porgId,ploginId,now() from tmp_knit_delivery_line tmp WHERE tmp.id = loopid2;
set pknitdelline_id = (SELECT LAST_INSERT_ID());
        INSERT INTO transcation_entry2 (knitdel_id, knitdel_line_id, workorderId, production_date, noOfRolls, entry_2, entry_2At, notes, createdBy, createdAt, orgId)
        SELECT pheaderId, pknitdelline_id, tfr.woId, pdate, tfr.noOfRolls, tfr.deliveryKgs, NOW(), pfactory, ploginId, NOW(), porgId FROM tmp_knit_delivery_line tfr WHERE tfr.id = loopid2;
        COMMIT;
        SET loopid2 = loopid2 + 1; 
    END WHILE;
END IF;
ELSE 
UPDATE knit_delivery kd
JOIN (SELECT SUM(noOfRolls) AS totalRolls, SUM(deliveryKgs) AS totalKg FROM tmp_knit_delivery_line) tmp ON 1=1
SET 
    kd.factory = pfactory,
    kd.date = pdate,
    kd.totalrolls = tmp.totalRolls,
    kd.totalKg = tmp.totalKg,
    kd.modifiedBy = ploginId,
    kd.modifiedAt = NOW()
WHERE 
    kd.id = pid 
    AND kd.orgId = porgId;

IF(pheaderQuery <> '')THEN
SET loopid = 1;
SET datacount = (select Count(*) from tmp_knit_delivery_line);

WHILE (loopid <= datacount) DO 
set pline_id = (select line_id from tmp_knit_delivery_line where id = loopid and orgId = porgId);

IF (pline_id = 0) then
insert into knit_delivery_line (knitDelId,dyeFactory,knitChallan,scandexChallan,buyer,orderNo,style,color,size,woId,noOfRolls,deliveryKgs,knitRate,knitValue,orgId,createdBy,createdAt)
select tmp.knitDelId,tmp.dyeFactory,tmp.knitChallan,tmp.scandexChallan,tmp.buyer,tmp.orderNo,tmp.style,tmp.color,tmp.size,tmp.woId,tmp.noOfRolls,tmp.deliveryKgs,tmp.knitRate,tmp.knitValue,porgId,ploginId,now() from tmp_knit_delivery_line tmp WHERE tmp.line_id = pline_id;
set pknitdelline2_id = (SELECT LAST_INSERT_ID());
INSERT INTO transcation_entry2 (knitdel_id, knitdel_line_id, workorderId, production_date, noOfRolls, entry_2, entry_2At, notes, createdBy, createdAt, orgId)
SELECT tfr.knitDelId, pknitdelline2_id, tfr.woId, pdate, tfr.noOfRolls, tfr.deliveryKgs, NOW(), pfactory, ploginId, NOW(), porgId FROM tmp_knit_delivery_line tfr WHERE tfr.line_id = pline_id;

ELSE 
UPDATE knit_delivery_line kl, tmp_knit_delivery_line tkl set 
kl.dyeFactory = tkl.dyeFactory,
kl.knitChallan = tkl.knitChallan,
kl.scandexChallan = tkl.scandexChallan,
kl.buyer = tkl.buyer,
kl.orderNo = tkl.orderNo,
kl.style = tkl.style,
kl.color = tkl.color,
kl.size = tkl.size,
kl.woId = tkl.woId,
kl.noOfRolls = tkl.noOfRolls,
kl.deliveryKgs = tkl.deliveryKgs,
kl.knitRate = tkl.knitRate,
kl.knitValue = tkl.knitValue
where kl.id = pline_id and kl.knitDelId = tkl.knitDelId and tkl.id= loopid;

