CREATE DEFINER=`root`@`localhost` PROCEDURE `ppost_po_master_line`(
    IN pid int(11),
    IN pheaderQuery longtext,
    IN ploginId int,
    IN porgId int
)
BEGIN
    DECLARE datacount INT;
    DECLARE loopid INT;
    DECLARE pline_id INT;

    DROP TEMPORARY TABLE IF EXISTS tmp_po_lines;
    CREATE TEMPORARY TABLE tmp_po_lines (
        id int(11) NOT NULL AUTO_INCREMENT,
        line_id int DEFAULT NULL,
        orderId int DEFAULT NULL,
        orderNo varchar(255) DEFAULT NULL,
        styleId int DEFAULT NULL,
        style varchar(245) DEFAULT NULL,
        sizeId int DEFAULT NULL,
        size varchar(255) DEFAULT NULL,
        quantity int DEFAULT NULL,
        poRate float DEFAULT NULL,
        poValue float DEFAULT NULL,
        popl float DEFAULT NULL,
        colorId int DEFAULT NULL,
        color varchar(255) DEFAULT NULL,
        createdAt int DEFAULT NULL,
        createdBy INT DEFAULT NULL,
        orgId INT DEFAULT NULL,
        PRIMARY KEY (id)
    ) ENGINE=InnoDB DEFAULT CHARSET=utf8;

    IF (pheaderQuery <> '') THEN
        SET @s1 = pheaderQuery;
        PREPARE stmt1 FROM @s1;
        EXECUTE stmt1;
        DEALLOCATE PREPARE stmt1;
    END IF;

    IF (pheaderQuery <> '') THEN
        SET loopid = 1;
        SET datacount = (SELECT COUNT(*) FROM tmp_po_lines WHERE orgId = porgId);

        WHILE (loopid <= datacount) DO
            SET pline_id = (SELECT line_id FROM tmp_po_lines WHERE id = loopid AND orgId = porgId);

            IF (pline_id IS NULL OR pline_id = 0) THEN
                INSERT INTO po_master_line (
                    orderId, orderNo, styleId, style, colorId, color, sizeId, size, 
                    quantity, poRate, poValue, popl, orgId, createdBy, createdAt
                )
                SELECT 
                    orderId, orderNo, styleId, style, colorId, color, sizeId, size, 
                    quantity, poRate, poValue, popl, orgId, createdBy, createdAt
                FROM tmp_po_lines 
                WHERE id = loopid;
            ELSE
                UPDATE po_master_line yl
                JOIN tmp_po_lines tyl ON yl.id = tyl.line_id
                SET 
                    yl.orderId = tyl.orderId,
                    yl.orderNo = tyl.orderNo,
                    yl.styleId = tyl.styleId,
                    yl.style = tyl.style,
                    yl.colorId = tyl.colorId,
                    yl.color = tyl.color,
                    yl.sizeId = tyl.sizeId,
                    yl.size = tyl.size,
                    yl.quantity = tyl.quantity,
                    yl.poRate = tyl.poRate,
                    yl.poValue = tyl.poValue,
                    yl.popl = tyl.popl,
                    yl.modifiedBy = ploginId,
                    yl.modifiedAt = NOW()
                WHERE tyl.id = loopid;
            END IF;

            COMMIT;
            SET loopid = loopid + 1;
        END WHILE;

        UPDATE po_master pm
        JOIN (
            SELECT orderId, SUM(quantity) AS totalQuantity, SUM(poValue) AS totalValue
            FROM tmp_po_lines
            WHERE orderId = pid
            GROUP BY orderId
        ) t ON pm.id = t.orderId
        SET pm.poQuantity = t.totalQuantity,
            pm.poValue = t.totalValue
        WHERE pm.id = pid;
    END IF;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
