IN `pheaderQuery` LONGTEXT, 
IN `ploginId` INT,
IN `porgId` INT)
BEGIN

DECLARE loopid INT;
DECLARE datacount INT;
DECLARE pid INT;


DROP TEMPORARY TABLE IF EXISTS tmp_sewing_input;
CREATE TEMPORARY TABLE `tmp_sewing_input` (
`id` INT(11) NOT NULL AUTO_INCREMENT,
`line_id` INT DEFAULT NULL,
`buyer` VARCHAR(255) DEFAULT NULL,
`orderNo` VARCHAR(255) DEFAULT NULL,
`style` VARCHAR(255) DEFAULT NULL,
`color` VARCHAR(255) DEFAULT NULL,
`size` VARCHAR(255) DEFAULT NULL,
`woId` INT DEFAULT NULL,
`cutId` INT DEFAULT NULL,
`inputDate` DATETIME DEFAULT NULL,
`bundleNo` VARCHAR(255) DEFAULT NULL,
`inputPcs` INT DEFAULT NULL,
`lineNo` INT DEFAULT NULL,
`createdBy` INT DEFAULT NULL,
`orgId` INT DEFAULT NULL,
PRIMARY KEY (id)
);

IF (pheaderQuery <> '') THEN
SET @s1 = pheaderQuery;
PREPARE stmt1 FROM @s1;
EXECUTE stmt1;
DEALLOCATE PREPARE stmt1;
END IF;

SET loopid = 1;
SET datacount = (SELECT COUNT(*) FROM tmp_sewing_input);
WHILE (loopid <= datacount) DO
SET pid = (SELECT line_id FROM tmp_sewing_input WHERE id = loopid);
IF (pid = 0) THEN
INSERT INTO sewing_input (
buyer, orderNo, style, color, size, woId, cutId, bundleNo, lineNo, inputPcs, inputDate, orgId, createdBy, createdAt
)
SELECT
buyer, orderNo, style, color, size, woId, cutId, bundleNo, lineNo, inputPcs, inputDate, porgId, ploginId, NOW()
FROM
tmp_sewing_input
WHERE
id = loopid AND line_id = pid;
ELSE
UPDATE sewing_input a, tmp_sewing_input b
SET 
a.woId = b.woId,
a.buyer = b.buyer,
a.orderNo = b.orderNo,
a.style = b.style,
a.color = b.color,
a.size = b.size,
a.cutId = b.cutId,
a.bundleNo = b.bundleNo,
a.lineNo = b.lineNo,
a.inputPcs = b.inputPcs,
a.inputDate = b.inputDate,
a.modifiedBy = ploginId,
a.modifiedAt = NOW()
WHERE 
a.id = pid AND b.line_id = pid AND a.orgId = porgId;
END IF;
SET loopid = loopid + 1;
END WHILE;
END ;;
DELIMITER ;
