CREATE DEFINER=`root`@`localhost` PROCEDURE `ppost_transcationentry_1`(
    IN `pid` INT(11),
    IN `pworkorderId` INT(11),
    IN `pentry` INT(11),
    IN `pfabricQuery` LONGTEXT,
    IN `ploginId` INT,
    IN `porgId` INT
)
BEGIN
    DECLARE datacount INT;
    DECLARE loopid INT;
    DECLARE lineId INT;

    DROP TEMPORARY TABLE IF EXISTS tmp_entry_1;
    CREATE TEMPORARY TABLE `tmp_entry_1` (
        `id` INT(11) NOT NULL AUTO_INCREMENT,
        `entryId` int,
        `workorderId` INT DEFAULT NULL,
        `days` INT DEFAULT NULL,
        `noOfRolls` INT DEFAULT NULL,
        `entry_1` float DEFAULT NULL,
        `notes` varchar(1000) DEFAULT NULL,
        `production_date` DATE,
        `createdBy` INT DEFAULT NULL,
        `orgId` INT DEFAULT NULL,
        PRIMARY KEY (`id`)
    ) ENGINE=InnoDB DEFAULT CHARSET=utf8;

    IF(pfabricQuery <> '') THEN
        SET @s1 = pfabricQuery;
        PREPARE stmt1 FROM @s1;
        EXECUTE stmt1;
        DEALLOCATE PREPARE stmt1;
    END IF;

    IF(pfabricQuery != '') THEN
        IF (pentry = 1) THEN
        SET loopid = 1;
        SET datacount = (select Count(*) from tmp_entry_1);
        WHILE (loopid <= datacount) DO 
        SET lineId = (select entryId from tmp_entry_1 where id=loopid and orgId = porgId);
IF (lineId <> 0) THEN
            UPDATE transcation_entry1 fr, tmp_entry_1 tfr
                SET fr.entry_1 = tfr.entry_1, 
                    fr.noOfRolls = tfr.noOfRolls, 
                    fr.notes = tfr.notes,
                    fr.entry_1At = NOW(),
                    fr.production_date = tfr.production_date,
                    fr.entry_1By = tfr.createdBy
                    where fr.workorderId = tfr.workorderId
                    AND fr.orgId = tfr.orgId 
                    AND fr.entry1_id = tfr.entryId;

                ELSE
                INSERT INTO transcation_entry1 (workorderId, entry_1, noOfRolls, notes, entry_1At, production_date, entry_1By, orgId)
SELECT tfr.workorderId, tfr.entry_1, tfr.noOfRolls, tfr.notes, NOW(), tfr.production_date, tfr.createdBy, tfr.orgId from tmp_entry_1 tfr where id=loopid;
                
                END IF;
COMMIT;
SET loopid = loopid + 1;
                END WHILE;
            END IF;
        END IF;
END ;;
