CREATE DEFINER=`root`@`localhost` PROCEDURE `ppost_workorder`(
IN `pid` int(11),
IN `pworkorderQuery` longtext,
IN `ploginId` int,
IN `porgId` int)
BEGIN

DECLARE prefCode VARCHAR(20);
DECLARE pbarcode VARCHAR(20);
DECLARE datacount INT;
DECLARE loopid INT;
DECLARE rolldatacount INT;
DECLARE rollloopid INT;
DECLARE pworkorderId INT;

DECLARE pbuyer varchar(245);
DECLARE porderNo varchar(245);
DECLARE pstyle varchar(245);
DECLARE pcolor varchar(245);
DECLARE psize varchar(245);

Drop temporary table if exists tmp_workorder;
CREATE temporary TABLE `tmp_workorder` ( 
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `poid` INT DEFAULT NULL,
  `polineId` INT DEFAULT NULL,
  `buyer` varchar(45) DEFAULT NULL,
  `orderNo` varchar(245) DEFAULT NULL,
  `style` varchar(245) DEFAULT NULL,
  `color` varchar(245) DEFAULT NULL,
  `size` varchar(245) DEFAULT NULL,
  `sizeid` INT DEFAULT NULL,
  `fabType` varchar(245) DEFAULT NULL,
  `fabricTypeId` INT DEFAULT NULL,
  `fabDia` varchar(245) DEFAULT NULL,
  `fabdiaId` INT DEFAULT NULL,
  `fabGsm` varchar(245) DEFAULT NULL,
  `fabrGSMId` INT DEFAULT NULL,
  `yarnKg` varchar(255) default null,
  `greigeKg` varchar(255) default null,
  `yarnType` varchar(245) DEFAULT NULL,
  `yarnTypeId` INT DEFAULT NULL,
  `finishKg` varchar(245) DEFAULT NULL,
  `knitSL` varchar(245) DEFAULT NULL,
  `spinFty` varchar(245) DEFAULT NULL,
  `spinFtyId` INT DEFAULT NULL,
  `knitFty` varchar(245) DEFAULT NULL,
  `knitFtyId` INT DEFAULT NULL,
  `dyeinFty` varchar(245) DEFAULT NULL,
  `dyeinFtyId` INT DEFAULT NULL,
  `orderPcs` varchar(245) DEFAULT NULL,  
  `orderFOBRate` varchar(245) DEFAULT NULL, 
  `knitRate` varchar(245) DEFAULT NULL,
  `dyeRate` varchar(245) DEFAULT NULL,
  `FSize` varchar(245) DEFAULT NULL,
  `noDays` varchar(245) DEFAULT NULL,
  `dyetype` varchar(245) default null,
  `dyeTypeId` int default null,
  `createdBy` INT DEFAULT NULL,
  `orgId` INT DEFAULT NULL,
   PRIMARY KEY (`id`)
   ) ENGINE=InnoDB DEFAULT CHARSET=utf8;

IF(pworkorderQuery <> '')THEN
SET @s1 = pworkorderQuery;
PREPARE stmt1 FROM @s1;
EXECUTE stmt1 ;
DEALLOCATE PREPARE stmt1;
END IF; 

if(pworkorderQuery != '') then
SET loopid = 1;
SET datacount = (select Count(*) from tmp_workorder);
WHILE (loopid <= datacount) DO 

set pbuyer = (select buyer from tmp_workorder where id = loopid and orgId = porgId );
set porderNo = (select orderNo from tmp_workorder where id = loopid and orgId = porgId );
set pstyle = (select style from tmp_workorder where id = loopid and orgId = porgId );
set pcolor = (select color from tmp_workorder where id = loopid and orgId = porgId );
set psize = (select size from tmp_workorder where id = loopid and orgId = porgId );

if not exists (select id from workorder where buyer = pbuyer and orderNo = porderNo and style = pstyle and color = pcolor and size = psize) then

insert into workorder (
code, 
poid, polineId, buyer, orderNo, style, color,
    size, sizeid, fabType, fabricTypeId, fabDia, fabdiaId,
    fabGsm, fabrGSMId, greigeKg, finishKg, knitSL, spinFty, 
    spinFtyId, knitFty, knitFtyId, dyeinFty, dyeinFtyId, yarnKg, 
orgId, createdBy, createdAt, 
yarnType, yarnTypeId, orderPcs, orderFOBRate, knitRate, dyeRate, 
    FSize, dyetype, dyeTypeId
    )
select 
fn_getCodeGen('WO',porgId), 
poid , polineId ,buyer, orderNo, style, color, 
    size, sizeid ,fabType, fabricTypeId ,fabDia, fabdiaId,
    fabGsm, fabrGSMId, greigeKg, finishKg, knitSL, spinFty,
    spinFtyId, knitFty, knitFtyId, dyeinFty, dyeinFtyId, YarnKg,
    porgId, ploginId, now(), 
yarnType, yarnTypeId, orderPcs, orderFOBRate, knitRate, dyeRate ,
    FSize, dyetype, dyeTypeId
    from tmp_workorder where id = loopid;
set pworkorderId = (SELECT LAST_INSERT_ID());

SET rollloopid = 1;
SET rolldatacount = (select noDays from tmp_workorder where id = loopid);
WHILE (rollloopid <= rolldatacount) DO 
insert into transcation_entry1 (workorderId,days,orgId, createdBy, createdAt) values 
(pworkorderId,rollloopid,porgId,ploginId,now());
insert into transcation_entry2 (workorderId,days,orgId, createdBy, createdAt) values 
(pworkorderId,rollloopid,porgId,ploginId,now());
insert into transcation_entry3 (workorderId,days,orgId, createdBy, createdAt) values 
(pworkorderId,rollloopid,porgId,ploginId,now());
insert into transcation_entry4 (workorderId,days,orgId, createdBy, createdAt) values 
(pworkorderId,rollloopid,porgId,ploginId,now());
insert into transcation_entry5 (workorderId,days,orgId, createdBy, createdAt) values 
(pworkorderId,rollloopid,porgId,ploginId,now());
insert into transcation_entry6 (workorderId,days,orgId, createdBy, createdAt) values 
(pworkorderId,rollloopid,porgId,ploginId,now());
insert into transcation_entry7 (workorderId,days,orgId, createdBy, createdAt) values 
(pworkorderId,rollloopid,porgId,ploginId,now());
commit;
SET rollloopid=rollloopid + 1; 
END WHILE;
else
update workorder wo , tmp_workorder two set 
wo.buyer = two.buyer,
wo.orderNo = two.orderNo,
wo.style = two.style,
wo.color = two.color,
wo.size = two.size,
wo.fabType = two.fabType,
wo.fabDia = two.fabDia,
wo.fabGsm = two.fabGsm,
wo.yarnKg = two.yarnKg,
wo.greigeKg = two.greigeKg,
wo.yarnType = two.yarnType,
wo.finishKg = two.finishKg,
wo.knitSL = two.knitSL,
wo.spinFty = two.spinFty,
wo.knitFty = two.knitFty,
wo.dyeinFty = two.dyeinFty,
wo.orderPcs = two.orderPcs,
wo.orderFOBRate = two.orderFOBRate,
wo.knitRate = two.knitRate,
wo.dyeRate = two.dyeRate,
wo.fSize = two.fSize,
wo.dyetype = two.dyetype,
wo.dyeTypeId = two.dyeTypeId,
wo.modifiedBy = ploginId,
wo.modifiedAt = now()
where wo.buyer = pbuyer and wo.orderNo = porderNo and wo.style = pstyle and wo.color = pcolor and wo.size = psize and two.id = loopid;

end if;
commit;
SET loopid=loopid + 1; 
END WHILE;

END IF;
END ;;
DELIMITER ;
