IN `plcValue` varchar(245),
IN `pyarnStatus` varchar(45),
IN `pheaderQuery` longtext,
IN `ploginId` int,
IN `porgId` int)
BEGIN

DECLARE datacount INT;
DECLARE loopid INT;
DECLARE pheaderId INT;
DECLARE pline_id INT;

Drop temporary table if exists tmp_yarn_lc_lines;
CREATE temporary TABLE `tmp_yarn_lc_lines` ( 
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `line_id` int(11) NULL,
  `yarnId` int DEFAULT NULL,
  `yarnType` varchar(255) DEFAULT NULL,
  `lcYarnKgs` varchar(255) DEFAULT NULL,
