  `orgId` INT DEFAULT NULL,
   PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

IF(pheaderQuery <> '')THEN
SET @s1 = pheaderQuery;
PREPARE stmt1 FROM @s1;
EXECUTE stmt1 ;
DEALLOCATE PREPARE stmt1;
END IF; 

if (pid = 0) then

insert into yarn (spinner,lcDate,lcNo,pi,piDate,lcYarnTotal,lcValue,yarnStatus,orgId,createdBy,createdAt) values 
(pspinner,plcDate,plcNo,ppi,ppiDate,PlcYarnTotal,plcValue,pyarnStatus,porgId,ploginId,now());
set pheaderId = (SELECT LAST_INSERT_ID());
insert into yarn_lc_lines (yarnId,yarnType,lcYarnKgs,yarnRate,yarnValue,orgId,createdBy,createdAt)
select pheaderId,yarnType,lcYarnKgs,yarnRate,yarnValue,orgId,createdBy,now() from tmp_yarn_lc_lines;

else 

UPDATE yarn set 
spinner = pspinner,
lcDate = plcDate,
lcNo = plcNo,
pi = ppi,
piDate = ppiDate,
lcYarnTotal = PlcYarnTotal,
lcValue = plcValue,
yarnStatus = pyarnStatus,
modifiedBy = ploginId,
modifiedAt = now()
where id = pid and orgId = porgId;

if(pheaderQuery != '') then
SET loopid = 1;
SET datacount = (select Count(*) from tmp_yarn_lc_lines);

WHILE (loopid <= datacount) DO 
set pline_id = (select line_id from tmp_yarn_lc_lines where id = loopid and orgId = porgId);

IF (pline_id = 0) then
INSERT INTO yarn_lc_lines (yarnId,yarnType,lcYarnKgs,yarnRate,yarnValue,orgId,createdBy,createdAt)
SELECT yarnId,yarnType,lcYarnKgs,yarnRate,yarnValue,orgId,createdBy,now() from tmp_yarn_lc_lines where id = loopid;
ELSE 
UPDATE yarn_lc_lines yl, tmp_yarn_lc_lines tyl set 
yl.yarnType = tyl.yarnType,
yl.lcYarnKgs = tyl.lcYarnKgs,
yl.yarnRate = tyl.yarnRate,
yl.yarnValue = tyl.yarnValue
where yl.id = tyl.line_id and yl.yarnId = pid; 
END IF;
COMMIT;
SET loopid = loopid + 1; 
END WHILE;
END IF;
END IF;
END ;;
