CREATE DEFINER=`root`@`localhost` PROCEDURE `ppost_yarn_quality_check`(
IN `pyarnId` int(11),
IN `pheaderQuery` longtext,
IN `ploginId` int,
IN `porgId` int)
BEGIN

DECLARE datacount INT;
DECLARE loopid INT;
DECLARE pheaderId INT;
DECLARE pline_id INT;

Drop temporary table if exists tmp_yarn_quality_check;
CREATE temporary TABLE `tmp_yarn_quality_check` ( 
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `line_id` int(11) DEFAULT NULL ,
  `yarnReceiptId` int DEFAULT NULL,
  `checkDate` datetime  DEFAULT NULL,
  `checkResults` varchar(255) DEFAULT NULL,
  `yarnAcceptRejectStatus` varchar(255) DEFAULT NULL,
  `createdBy` INT DEFAULT NULL,
  `orgId` INT DEFAULT NULL,
   PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

IF(pheaderQuery <> '')THEN
SET @s1 = pheaderQuery;
PREPARE stmt1 FROM @s1;
EXECUTE stmt1 ;
DEALLOCATE PREPARE stmt1;
END IF; 


if(pheaderQuery != '') then
SET loopid = 1;
SET datacount = (select Count(*) from tmp_yarn_quality_check);

WHILE (loopid <= datacount) DO 
set pline_id = (select line_id from tmp_yarn_quality_check where id = loopid and orgId = porgId);

IF (pline_id = 0) then
INSERT INTO yarn_quality_check (yarnId, yarnReceiptId, checkDate, checkResults, yarnAcceptRejectStatus,orgId,createdBy,createdAt)
SELECT pyarnId, yarnReceiptId, checkDate, checkResults, yarnAcceptRejectStatus,orgId,createdBy,now() from tmp_yarn_quality_check where id = loopid;
ELSE 
UPDATE yarn_quality_check yl, tmp_yarn_quality_check tyl set 
yl.yarnReceiptId = tyl.yarnReceiptId,
yl.checkDate = tyl.checkDate,
yl.checkResults = tyl.checkResults,
yl.yarnAcceptRejectStatus = tyl.yarnAcceptRejectStatus,
yl.modifiedBy = tyl.createdBy,
yl.modifiedAt = now()
where yl.id = tyl.line_id and yl.yarnId = pyarnId; 
END IF;
COMMIT;
SET loopid = loopid + 1; 
END WHILE;
END IF;
END ;;
