CREATE DEFINER=`root`@`localhost` PROCEDURE `pview_dye`(IN `pid` int,IN `porgId` int)
BEGIN
select 
 d.id,
 d.code, 
 d.dyeFactory,
 d.buyer,
 d.orderNo,
 d.style,
 d.color,
 d.fabricType,
 d.softner,
 d.silicon,
 d.enzyme,
 d.batchNo,
 d.batchRemarks,
 d.batch_batchMakeDate,
 d.batch_batchRollsSLCheck,
 d.dyeing_loadDatetime,
 d.dyeing_unloadingDateTime,
 d.dyeing_totalRunTime,
 d.dyeing_receipeChart,
 d.shade_lapDipOriginalQTX,
 d.shade_masterBatchCheck,
 d.shade_dyeUnloadShadeCheck,
 d.shade_shadeSubmissionDate,
 d.shade_shadeApprovalDate,
 d.shade_firstBatchNotOkReason,
 d.squeezer_squeezerDateTime,
 d.squeezer_rpmValue,
 d.squeezer_trolleyPlate,
 d.squeezer_overfeedValue,
 d.squeezer_padderPressureValue,
 d.squeezer_shape,squeezer_backAngle,
 d.dryer_dryerDatetime,
 d.dryer_temperatureValue,
 d.dryer_rpmValue,
 d.dryer_overfeedValue,
 d.calendar_rpmValue,
 d.calendar_steamHighLow,
 d.slitting_slittingDatetime,
 d.slitting_DTwister,
 d.slitting_trolleyPlate,
 d.stenter_stenterDatetime,
 d.stenter_temperatureValue,
 d.stenter_overfeedValue,
 d.stenter_diasettingValue,
 d.stenter_softnerSiliconUsage,
 d.compact_openCompactDatetime,
 d.compact_rpmValue,
 d.compact_overfeedValue,
 d.compact_diasettingValue,
 d.compact_steamHighLow,
 d.tubtex_tubtexDatetime,
 d.tubtex_yarnLot,
 d.tubtex_overfeedValue,
 d.tubtex_steamHighLow,
 d.tubtex_rollerKnifeSetting,
 d.tubtex_sideLoosePileCheck,
 d.tubtex_diaGSMCheck,
 d.tubtex_shadeLightBoxDataColor,
 d.finalbatch_shrinkageTwistingReport,
 d.finalbatch_GSMReport,
 d.finalbatch_rollRollShadeCheck,
 d.finalbatch_rubbingReportWetDry,
 d.finalbatch_phReportInhouseCheck,
 d.finalbatch_phenolicYellowingTest,
 d.finalbatch_qcInspectionReport,
 d.finalbatch_batchRollsWeight,
 d.finalbatch_finishRollsWeight,
 d.finalbatch_processLoss,
 d.finalbatch_fabricDeliveryDatetime,
 d.orgId,
 d.createdAt ,
round(sum(dl.griege),2)  as griegeTotal,
round(sum(dl.finish),2) as finishTotal,
round(sum(dl.difference),2) as DifferenceTotal,
round(sum(dl.processloss),2) as ProcesslossTotal
 from dye d left join dye_line dl on  d.id = dl.dyeId
where d.orgId = porgId and d.id = pid and d.status = 1 and d.delStatus = 0 group by id;

select id,dyeId,size,woId,greigerolls,griege,finishrolls,finish,difference,processloss,orgId,createdAt from dye_line
where orgId = porgId and dyeId = pid and status = 1 and delStatus = 0; 
