CREATE DEFINER=`root`@`localhost` PROCEDURE `pview_dyeworkorder`(IN `pid` int,IN `porgId` int)
BEGIN
SELECT 
    kt.id, 
    kt.dyefty, 
    kt.dyefty_details, 
    kt.buyer,
    kt.orderNo,
    kt.woNo,
    kt.woRefNo,
    DATE_FORMAT(kt.woDate, '%Y-%m-%d') as woDate, 
    DATE_FORMAT(kt.completedDate, '%Y-%m-%d') as completedDate, 
kt.dyeKgs,
    kt.dyeValue,
    kt.notes,
    kt.orgId, 
    kt.createdAt 
FROM 
    dyeworkorder kt 
