CREATE DEFINER=`root`@`localhost` PROCEDURE `pview_role`(IN `porgId` INT, IN `id` INT)
BEGIN
    SELECT 
        r.id, 
        r.name, 
        JSON_ARRAYAGG(JSON_OBJECT('profileName', p.profileName)) AS profiles
    FROM  
        roles r
    LEFT JOIN 
        roles_profile rp ON rp.roleId = r.id
    LEFT JOIN 
        profile p ON p.id = rp.profileId
    WHERE 
        r.orgId = porgId AND r.id = id AND r.status = 1 AND r.delStatus = 0
    GROUP BY 
        r.id, r.name; 
END ;;
