DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pview_yarn_report_2`(IN `pid` int, IN `porgId` int)
BEGIN
    DECLARE loopid INT DEFAULT 1;
    DECLARE loopid2 INT DEFAULT 1;
    DECLARE loopid3 INT DEFAULT 1;
    DECLARE loopid4 INT DEFAULT 1;
    DECLARE line_id INT;
    DECLARE datacount INT;
    DECLARE datacount2 INT;
    DECLARE datacount3 INT;
    DECLARE datacount4 INT;
    DECLARE orderId INT;
    DECLARE yarn_rec_Id INT;
    DECLARE qualityId INT;

    DROP TEMPORARY TABLE IF EXISTS tmp_yarn_line;
    CREATE TEMPORARY TABLE `tmp_yarn_line` ( 
        `id` INT NOT NULL AUTO_INCREMENT,
        `yarnId` INT DEFAULT NULL,
        `yarnType` VARCHAR(255) DEFAULT NULL,
        `yarn_line_id` INT DEFAULT NULL,
        `orgId` INT DEFAULT NULL,
        PRIMARY KEY (`id`)
    ) ENGINE=InnoDB DEFAULT CHARSET=utf8;

    INSERT INTO tmp_yarn_line (yarnId, yarnType, yarn_line_id, orgId)
    SELECT yarnId, yarnType, id, orgId 
    FROM yarn_lc_lines 
    WHERE orgId = porgId AND yarnId = pid AND status = 1 AND delStatus = 0;

    SELECT id, spinner, DATE_FORMAT(lcDate, "%Y-%m-%d") as lcDate, lcNo, pi, DATE_FORMAT(piDate, "%Y-%m-%d") as piDate, lcYarnTotal, lcValue, yarnStatus, orgId, createdAt ,
    (select sum(receiptYarnKgs) from yarn_receipts_lines where yarnId = pid AND delStatus = 0 ) as recQty 
    FROM yarn 
    WHERE orgId = porgId AND id = pid AND status = 1 AND delStatus = 0;

    DROP TEMPORARY TABLE IF EXISTS combined_results;
    CREATE TEMPORARY TABLE combined_results ( 
        `id` INT NOT NULL AUTO_INCREMENT,
        `yarnId` INT DEFAULT NULL,
        `yarnType` VARCHAR(255) DEFAULT NULL,
        `yarn_line_id` INT DEFAULT NULL,
        `lcYarnKgs` VARCHAR(255) DEFAULT NULL,
        `yarnRate` VARCHAR(255) DEFAULT NULL,
        `yarnValue` VARCHAR(255) DEFAULT NULL,
        `recQty` int DEFAULT NULL,
        `lotcheck` LONGTEXT DEFAULT NULL,
        `order_allocation` LONGTEXT DEFAULT NULL,
        `orgId` INT DEFAULT NULL,
        PRIMARY KEY (`id`)
    ) ENGINE=InnoDB DEFAULT CHARSET=utf8;

    SET datacount = (SELECT COUNT(*) FROM tmp_yarn_line WHERE orgId = porgId);

    WHILE (loopid <= datacount) DO
        SET line_id = (SELECT yarn_line_id FROM tmp_yarn_line WHERE orgId = porgId AND id = loopid);

        DROP TEMPORARY TABLE IF EXISTS tmp_order_allocation;
        CREATE TEMPORARY TABLE tmp_order_allocation ( 
            `id` INT NOT NULL AUTO_INCREMENT,
            `yarnId` INT DEFAULT NULL,
            `yarnLineId` INT DEFAULT NULL,
            `order_Id` INT DEFAULT NULL,
            `yarnType` VARCHAR(200) DEFAULT NULL,
            `buyer` VARCHAR(255) DEFAULT NULL,
            `utilisationOrderNo` VARCHAR(100) DEFAULT NULL,
            `colour` VARCHAR(255) DEFAULT NULL,
            `style` VARCHAR(255) DEFAULT NULL,
            `lotNo` VARCHAR(255) DEFAULT NULL,
            `allocatedYarnKgs` VARCHAR(245) DEFAULT NULL,
            `unallocatedYarnKgs` VARCHAR(245) DEFAULT NULL,
            `receipt` LONGTEXT,
            `orgId` INT DEFAULT NULL,
            PRIMARY KEY (`id`)
        ) ENGINE=InnoDB DEFAULT CHARSET=utf8;

        DROP TEMPORARY TABLE IF EXISTS tmp_order_line;
        CREATE TEMPORARY TABLE tmp_order_line ( 
            `id` INT NOT NULL AUTO_INCREMENT,
            `yarnId` INT DEFAULT NULL,
            `order_Id` INT DEFAULT NULL,
            `yarnLineId` INT DEFAULT NULL,
            `orgId` INT DEFAULT NULL,
            PRIMARY KEY (`id`)
        ) ENGINE=InnoDB DEFAULT CHARSET=utf8;

        INSERT INTO tmp_order_line (yarnId, order_Id, yarnLineId, orgId)
        SELECT yarnId, id, yarnLineId, orgId 
        FROM yarn_order_allocations 
        WHERE orgId = porgId AND yarnId = pid AND yarnLineId = line_id AND status = 1 AND delStatus = 0;

        SET loopid2 = 1;
        SET datacount2 = (SELECT COUNT(*) FROM tmp_order_line);

        WHILE (loopid2 <= datacount2) DO
            SET orderId = (SELECT order_Id FROM tmp_order_line WHERE id = loopid2);
            
            DROP TEMPORARY TABLE IF EXISTS tmp_receipt_data;
            CREATE TEMPORARY TABLE tmp_receipt_data ( 
                `id` INT NOT NULL AUTO_INCREMENT,
                `receipt_Id` INT DEFAULT 0,
                `yarnId` INT DEFAULT 0,
                `yarnOrderId` INT DEFAULT 0,
                `spinningChallan` VARCHAR(100) DEFAULT 0,
                `scandexChallan` VARCHAR(255) DEFAULT 0,
                `receiptDt` DATETIME,
                `knitFactory` VARCHAR(255) DEFAULT 0,
                `BagsCtnNos` VARCHAR(255) DEFAULT 0,
                `receiptYarnKgs` VARCHAR(255) DEFAULT 0,
                `pendingReceiptKgs` VARCHAR(255) DEFAULT 0,
                `quality` LONGTEXT,
                `orgId` INT DEFAULT NULL,
                PRIMARY KEY (`id`)
            ) ENGINE=InnoDB DEFAULT CHARSET=utf8;

            DROP TEMPORARY TABLE IF EXISTS tmp_receipt_line;
            CREATE TEMPORARY TABLE `tmp_receipt_line` ( 
                `id` INT NOT NULL AUTO_INCREMENT,
                `yarnId` INT DEFAULT NULL,
                `receipt_Id` INT DEFAULT NULL,
                `yarnOrderId` INT DEFAULT NULL,
                `orgId` INT DEFAULT NULL,
                PRIMARY KEY (`id`)
            ) ENGINE=InnoDB DEFAULT CHARSET=utf8;

            INSERT INTO tmp_receipt_line (yarnId, receipt_Id, yarnOrderId, orgId)
            SELECT yarnId, id, yarnOrderId, orgId 
            FROM yarn_receipts_lines 
            WHERE yarnOrderId = orderId AND yarnId = pid AND status = 1 AND delStatus = 0;
            
            SET loopid3 = 1;
            SET datacount3 = (SELECT COUNT(*) FROM tmp_receipt_line);

            WHILE (loopid3 <= datacount3) DO
                SET yarn_rec_Id = (SELECT receipt_Id FROM tmp_receipt_line WHERE id = loopid3);

                DROP TEMPORARY TABLE IF EXISTS tmp_quality_data;
                CREATE TEMPORARY TABLE tmp_quality_data ( 
                    `id` INT NOT NULL AUTO_INCREMENT,
                    `quality_Id` INT DEFAULT NULL,
                    `yarnReceipt_Id` INT DEFAULT NULL,
                    `yarnId` INT DEFAULT NULL,
                    `checkDate` DATETIME DEFAULT NULL,
                    `checkResults` VARCHAR(255) DEFAULT NULL,
                    `yarnAcceptRejectStatus` VARCHAR(255) DEFAULT NULL,
                    `orgId` INT DEFAULT NULL,
                    PRIMARY KEY (`id`)
                ) ENGINE=InnoDB DEFAULT CHARSET=utf8;

                DROP TEMPORARY TABLE IF EXISTS tmp_quality_line;
                CREATE TEMPORARY TABLE tmp_quality_line ( 
                    `id` INT NOT NULL AUTO_INCREMENT,
                    `quality_Id` INT DEFAULT NULL,
                    `yarnReceipt_Id` INT DEFAULT NULL,
                    `yarnId` INT DEFAULT NULL,
                    `orgId` INT DEFAULT NULL,
                    PRIMARY KEY (`id`)
                ) ENGINE=InnoDB DEFAULT CHARSET=utf8;

                INSERT INTO tmp_quality_line (quality_Id, yarnReceipt_Id, yarnId, orgId)
                SELECT id, yarnReceiptId, yarnId, orgId 
                FROM yarn_quality_check
                WHERE yarnReceiptId = yarn_rec_Id AND status = 1 AND delStatus = 0;

                SET loopid4 = 1;
                SET datacount4 = (SELECT COUNT(*) FROM tmp_quality_line);

                WHILE (loopid4 <= datacount4) DO
                    SET qualityId = (SELECT quality_Id FROM tmp_quality_line WHERE id = loopid4);

                    INSERT INTO tmp_quality_data (yarnId, yarnReceipt_Id, checkDate, checkResults, yarnAcceptRejectStatus)
                    SELECT yarnId, yarnReceiptId, checkDate, checkResults, yarnAcceptRejectStatus 
                    FROM yarn_quality_check
                    WHERE id = qualityId
                    AND status = 1 AND delStatus = 0 ;
                    
    
                    SET loopid4 = loopid4 + 1;
                END WHILE;

                INSERT INTO tmp_receipt_data (receipt_Id, yarnId, yarnOrderId, spinningChallan, scandexChallan, receiptDt, knitFactory, BagsCtnNos, receiptYarnKgs, pendingReceiptKgs, quality)
                SELECT id, yarnId, yarnOrderId, spinningChallan, scandexChallan, receiptDt, knitFactory, BagsCtnNos, receiptYarnKgs, pendingReceiptKgs,
                IFNULL(
                    (
                        SELECT REPLACE(
                            JSON_ARRAYAGG(
                                JSON_OBJECT(
                                    'qualityId', quality.quality_Id, 
                                    'yarnReceiptId', quality.yarnReceipt_Id, 
                                    'yarnId', quality.yarnId, 
                                    'checkDate', DATE_FORMAT(quality.checkDate, "%Y-%m-%d"), 
                                    'checkResults', quality.checkResults, 
                                    'yarnAcceptRejectStatus', quality.yarnAcceptRejectStatus,
                                    'orgId', quality.orgId
                                )
                            ) 
                        , '\"', '')
                        FROM tmp_quality_data quality
                    ),
                   JSON_ARRAY()
                ) AS quality 
                FROM yarn_receipts_lines 
                WHERE id = yarn_rec_Id AND yarnId = pid AND yarnOrderId = orderId AND orgId = porgId 
                AND status = 1 AND delStatus = 0 ;

                SET loopid3 = loopid3 + 1;
            END WHILE;

            INSERT INTO tmp_order_allocation (yarnId, yarnLineId, order_Id, yarnType, buyer, utilisationOrderNo, colour, style, lotNo, allocatedYarnKgs, unallocatedYarnKgs, receipt, orgId)
            SELECT yarnId, yarnLineId, id, yarnType, buyer, utilisationOrderNo, colour, style, lotNo, allocatedYarnKgs, unallocatedYarnKgs,
            IFNULL(
                (
                    SELECT REPLACE(
                        JSON_ARRAYAGG(
                            JSON_OBJECT(
                                'id', receipt.id, 
                                'yarnId', receipt.yarnId, 
                                'receiptId', receipt.receipt_Id, 
                                'yarnOrderId', receipt.yarnOrderId, 
                                'spinningChallan', receipt.spinningChallan, 
                                'scandexChallan', receipt.scandexChallan,
                                'receiptDt', DATE_FORMAT(receipt.receiptDt, "%Y-%m-%d"),
                                'knitFactory', receipt.knitFactory,
                                'BagsCtnNos', receipt.BagsCtnNos,
                                'receiptYarnKgs', receipt.receiptYarnKgs,
                                'pendingReceiptKgs', receipt.pendingReceiptKgs,
                                'quality', receipt.quality,
                                'orgId', receipt.orgId
                            )
                        )
                    , '\"', '')
                    FROM tmp_receipt_data receipt
                ),
                JSON_ARRAY()
            ) AS receipt, 
            orgId 
            FROM yarn_order_allocations 
            WHERE id = orderId AND yarnId = pid AND orgId = porgId AND status = 1 AND delStatus = 0 ;

            SET loopid2 = loopid2 + 1;
        END WHILE;

        INSERT INTO combined_results (yarnId, yarnType, yarn_line_id, lcYarnKgs, yarnRate, yarnValue, recQty , lotcheck, order_allocation,orgId)
        SELECT yarnId, yarnType, id, lcYarnKgs, yarnRate, yarnValue, (select sum(receiptYarnKgs) from yarn_receipts_lines where yarnId = line_id AND status = 1 AND delStatus = 0),
        IFNULL(
            (
                SELECT REPLACE(
                    JSON_ARRAYAGG(
                        JSON_OBJECT(
                            'id', lot.id, 
                            'yarnId', lot.yarnId, 
                            'yarnLineId', lot.yarnLineId, 
                            'yarnType', lot.yarnType, 
                            'lotNo', lot.lotNo,
                            'allocatedQty', (select sum(b.allocatedYarnKgs) from yarn_order_allocations b where b.yarnId = pid and lot.lotNo = b.lotNo and b.delStatus = 0 and b.status = 1),
                            'receiptQty', (select sum(b.receiptYarnKgs) from yarn_order_allocations a left join yarn_receipts_lines b on a.id = b.yarnOrderId where a.yarnId = pid and b.yarnId = pid and lot.lotNo = a.lotNo and a.delStatus = 0 and a.status = 1 and b.delStatus = 0 and b.status = 1),
                            'sampleDate', DATE_FORMAT(lot.sampleDate, "%Y-%m-%d"), 
                            'resultDate', DATE_FORMAT(lot.resultDate, "%Y-%m-%d"), 
                            'checkResults', lot.checkResults, 
                            'acceptRejectStatus', lot.acceptRejectStatus, 
                            'orgId', lot.orgId, 
                            'createdAt', lot.createdAt
                        )
                    )
                , '\"', '')
                FROM yarn_lot_check lot
                WHERE lot.orgId = porgId 
                AND lot.yarnId = pid
                AND lot.status = 1 
                AND lot.delStatus = 0
                AND lot.yarnLineId = line_id
            ),
            JSON_ARRAY()
        ) AS lotCheck, 
        IFNULL(
            (
                SELECT REPLACE(
                    JSON_ARRAYAGG(
                        JSON_OBJECT(
                            'id', orderall.id, 
                            'yarnId', orderall.yarnId, 
                            'yarnLineId', orderall.yarnLineId, 
                            'yarnType', orderall.yarnType, 
                            'order_Id', orderall.order_Id,
                            'buyer', orderall.buyer,
                            'utilisationOrderNo', orderall.utilisationOrderNo, 
                            'colour', orderall.colour,
                            'style', orderall.style,
                            'lotNo', orderall.lotNo, 
                            'allocatedYarnKgs', orderall.allocatedYarnKgs,
                            'unallocatedYarnKgs', orderall.unallocatedYarnKgs,
                            'receipt', orderall.receipt,
                            'orgId', orderall.orgId
                        )
                    )
                , '\"', '')
                FROM tmp_order_allocation orderall
                WHERE orderall.orgId = porgId 
                AND orderall.yarnId = pid
            ),
           JSON_ARRAY()
        ) AS order_allocation, 
        orgId 
        FROM yarn_lc_lines 
        WHERE id = line_id
        AND yarnId = pid 
        AND orgId = porgId
        AND status = 1 AND delStatus = 0 ;

        SET loopid = loopid + 1;
    END WHILE;

    SELECT * FROM combined_results;

    DROP TEMPORARY TABLE IF EXISTS combined_results;
END ;;
