CREATE DEFINER=`root`@`localhost` PROCEDURE `pyarn_reconciliation`(IN `pdate1` date , IN `pdate2` date ,IN `porgId` int)
BEGIN
select 
ANY_VALUE(knitFty) as knitFty, 
buyer, 
    orderNo, 
    style, 
    color, 
ANY_VALUE(WocreatedAt) as WocreatedAt, 
    sum( greigeKg ) as greigeKg , 
sum( Entry2 ) as Entry2, 
    sum( allocatedYarnKgs ) as allocatedYarnKgs, 
    sum( receiptYarnKgs ) as receiptYarnKgs, 
    ANY_VALUE(kncreatedAt) as kncreatedAt, 
    ANY_VALUE(production_date ) as production_date, 
    ANY_VALUE(yoacreatedAt) as yoacreatedAt, 
    ANY_VALUE(yrlreceiptDt) as yrlreceiptDt

 from (
SELECT 
    ANY_VALUE(kn.factory) AS knitFty,
    WO.buyer, 
    WO.orderNo, 
    WO.style, 
    WO.color, 
    ANY_VALUE(DATE_FORMAT(WO.createdAt, '%Y-%m-%d')) AS WocreatedAt,
    ANY_VALUE(WO.greigeKg) AS greigeKg, 
    ANY_VALUE(te2.entry_2) AS Entry2,
    ANY_VALUE(yoa.allocatedYarnKgs) AS allocatedYarnKgs, 
    ANY_VALUE(yrl.receiptYarnKgs) AS receiptYarnKgs,
    ANY_VALUE(DATE_FORMAT(kn.createdAt, '%Y-%m-%d')) AS kncreatedAt,
    ANY_VALUE(DATE_FORMAT(te2.production_date, '%Y-%m-%d')) AS production_date,
    ANY_VALUE(DATE_FORMAT(yoa.createdAt, '%Y-%m-%d')) AS yoacreatedAt,
    ANY_VALUE(DATE_FORMAT(yrl.receiptDt, '%Y-%m-%d')) AS yrlreceiptDt
FROM 
    workorder WO 
JOIN 
    (SELECT 
         k.factory, 
         kl.buyer, 
         kl.orderNo, 
         kl.style, 
         kl.color, 
         k.createdAt  
     FROM 
         knit AS k 
     JOIN 
         knit_line kl 
     ON 
         k.id = kl.knitId
    ) AS kn 
ON 
    WO.buyer = kn.buyer 
    AND WO.orderNo = kn.orderNo 
    AND WO.style = kn.style 
    AND WO.color = kn.color
JOIN 
    transcation_entry2 te2 
ON 
    WO.id = te2.workorderId 
JOIN 
    yarn_order_allocations yoa 
ON  
    WO.buyer = yoa.buyer 
    AND WO.orderNo = yoa.utilisationOrderNo 
    AND WO.style = yoa.style 
    AND WO.color = yoa.colour
JOIN 
    yarn_receipts_lines yrl 
ON 
    yoa.yarnId = yrl.yarnId
GROUP BY  
    WO.buyer, 
    WO.orderNo, 
    WO.style, 
    WO.color ) as DyeBatch 
    where  kncreatedAt BETWEEN pdate1 AND pdate2
        AND production_date BETWEEN pdate1 AND pdate2
        AND yoacreatedAt BETWEEN pdate1 AND pdate2
        AND yrlreceiptDt BETWEEN pdate1 AND pdate2
    GROUP BY  buyer, 
    orderNo, 
    style, 
    color;
END ;;
